insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MMM', '3M Company', 'The 3M Company is an American multinational conglomerate corporation operating in the fields of industry, worker safety, US health care, and consumer goods. The company produces over 60,000 products under several brands, including adhesives, abrasives, laminates, passive fire protection, personal protective equipment, window films, paint protection films, dental and orthodontic products, electrical and electronic connecting and insulating materials, medical products, car-care products, electronic circuits, healthcare software and optical films. It is based in Maplewood, a suburb of Saint Paul, Minnesota.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AOS', 'Smith AO Corporation', 'A. O. Smith Corporation is an American manufacturer of both residential and commercial water heaters and boilers and the largest manufacturer and marketer of water heaters in North America. It also supplies water treatment products in the Asian market.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ABT', 'Abbott Laboratories', 'Abbott Laboratories is an American multinational medical devices and health care company with headquarters in Abbott Park, Illinois, United States. The company was founded by Chicago physician Wallace Calvin Abbott in 1888 to formulate known drugs; today, it sells medical devices, diagnostics, branded generic medicines and nutritional products. It split off its research-based pharmaceuticals business into AbbVie in 2013.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ABBV', 'AbbVie Inc', 'AbbVie is an American publicly traded biopharmaceutical company founded in 2013. It originated as a spin-off of Abbott Laboratories.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ACN', 'Accenture plc', 'Accenture plc is an Irish-domiciled multinational company that provides consulting and processing services. It has been incorporated in Dublin, Ireland since 2009.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ATVI', 'Activision Blizzard Inc', 'Activision Blizzard, Inc. is an American video game holding company based in Santa Monica, California. Activision Blizzard currently includes five business units: Activision Publishing, Blizzard Entertainment, King, Major League Gaming, and Activision Blizzard Studios.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ADM', 'Archer-Daniels-Midland Company', 'The Archer-Daniels-Midland Company, commonly known as ADM, is an American multinational food processing and commodities trading corporation founded in 1902 and headquartered in Chicago, Illinois. The company operates more than 270 plants and 420 crop procurement facilities worldwide, where cereal grains and oilseeds are processed into products used in food, beverage, nutraceutical, industrial, and animal feed markets worldwide.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ADBE', 'Adobe Systems Incorporated', 'Adobe Inc. is an American multinational computer software company. Incorporated in Delaware and headquartered in San Jose, California, it has historically specialized in software for the creation and publication of a wide range of content, including graphics, photography, illustration, animation, multimedia, motion pictures and print. The company has expanded into digital marketing management software. Adobe has millions of users worldwide. Flagship products include: Photoshop image editing software, Adobe Illustrator vector-based illustration software, Adobe Acrobat Reader and the Portable Document Format (PDF), plus a host of tools primarily for audio-visual content creation, editing and publishing.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AAP', 'Advance Auto Parts Inc', 'Advance Auto Parts, Inc. (Advance) is an American automotive aftermarket parts provider. Headquartered in Raleigh, North Carolina, it serves both professional installer and do-it-yourself (DIY) customers.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AMD', 'Advanced Micro Devices Inc', 'Advanced Micro Devices, Inc. (AMD) is an American multinational semiconductor company based in Santa Clara, California, that develops computer processors and related technologies for business and consumer markets. AMDs main products include microprocessors, motherboard chipsets, embedded processors and graphics processors for servers, workstations, personal computers and embedded system applications.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AES', 'The AES Corporation', 'The AES Corporation is a Fortune 500 company that generates and distributes electrical power. AES is headquartered in Arlington, Virginia.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AFL', 'Aflac Incorporated', 'Aflac Inc. (American Family Life Assurance Company) is an American insurance company and is the largest provider of supplemental insurance in the United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'A', 'Agilent Technologies Inc', 'Agilent Technologies, Inc. is an American analytical instrumentation development and manufacturing company that offers its products and services to markets worldwide. Its global headquarters is located in Santa Clara, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'APD', 'Air Products and Chemicals Inc', 'Air Products and Chemicals, Inc. is an American international corporation whose principal business is selling gases and chemicals for industrial uses. Air Products headquarters is in Allentown, Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AKAM', 'Akamai Technologies Inc', 'Akamai Technologies, Inc. is a global content delivery network (CDN), cybersecurity, and cloud service company, providing web and Internet security services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ALK', 'Alaska Air Group Inc', 'Alaska Air Group is an airline holding company based in SeaTac, Washington, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ALB', 'Albemarle Corp', 'Albemarle Corporation is a fine chemical manufacturing company based in Charlotte, North Carolina.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ARE', 'Alexandria Real Estate Equities Inc', 'Alexandria Real Estate Equities, Inc. is an American real estate investment trust that invests in office buildings and laboratories leased to tenants in the life science and technology industries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ALGN', 'Align Technology Inc', 'Align Technology is a manufacturer of 3D digital scanners and the Invisalign clear aligners used in orthodontics. It is headquartered in San Jose, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ALLE', 'Allegion PLC', 'Allegion plc is an American-Irish provider based in Dublin of security products, for homes and businesses. It comprises thirty one global brands, including CISA, Interflex, LCN, Schlage and Von Duprin.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LNT', 'Alliant Energy Corp', 'Alliant Energy is a public utility holding company headquartered in Madison, Wisconsin providing power in Iowa and Wisconsin.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ALL', 'The Allstate Corporation', 'The Allstate Corporation is an American insurance company, headquartered in Northfield Township, Illinois.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GOOGL', 'Alphabet Inc Class A', 'Alphabet Inc. is an American multinational conglomerate headquartered in Mountain View, California. It was created through a restructuring of Google on October 2, 2015, and became the parent company of Google and several former Google subsidiaries. The two co-founders of Google remained as controlling shareholders, board members, and employees at Alphabet. Alphabet is the worlds fourth-largest technology company by revenue and one of the worlds most valuable companies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GOOG', 'Alphabet Inc Class C', 'Alphabet Inc. is an American multinational conglomerate headquartered in Mountain View, California. It was created through a restructuring of Google on October 2, 2015, and became the parent company of Google and several former Google subsidiaries. The two co-founders of Google remained as controlling shareholders, board members, and employees at Alphabet. Alphabet is the worlds fourth-largest technology company by revenue and one of the worlds most valuable companies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MO', 'Altria Group', 'Altria Group, Inc. (previously known as Philip Morris Companies, Inc.) is an American corporation and one of the worlds largest producers and marketers of tobacco, cigarettes and related products. It operates worldwide and is headquartered in unincorporated Henrico County, Virginia, just outside the city of Richmond.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AMZN', 'Amazon.com Inc', 'Amazon.com, Inc. is an American multinational technology company which focuses on e-commerce, cloud computing, digital streaming, and artificial intelligence. It is one of the Big Five companies in the U.S. information technology industry, along with Google, Apple, Microsoft, and Facebook. The company has been referred to as one of the most influential economic and cultural forces in the world, as well as the worlds most valuable brand.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AMCR', 'Amcor PLC', 'Amcor plc is an Australian-American, UK-domiciled packaging company. It develops and produces flexible packaging, rigid containers, specialty cartons, closures and services for food, beverage, pharmaceutical, medical-device, home and personal-care, and other products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AEE', 'Ameren Corp', 'Ameren Corporation is an American power company created December 31, 1997, by the merger of St. Louis, Missouris Union Electric Company (formerly NYSE: UEP) and the neighboring Central Illinois Public Service Company (CIPSCO Inc. holding, formerly NYSE: CIP) of Springfield, Illinois. It is now a holding company for several power companies and energy companies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AAL', 'American Airlines Group', 'American Airlines Group Inc. is an American publicly traded airline holding company headquartered in Fort Worth, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AEP', 'American Electric Power Company Inc', 'American Electric Power (AEP) is a major investor-owned electric utility in the United States, delivering electricity to more than five million customers in 11 states.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AXP', 'American Express Company', 'The American Express Company is a multinational financial services corporation headquartered at 200 Vesey Street in the Battery Park City neighborhood of Lower Manhattan in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AIG', 'American International Group Inc', 'American International Group, Inc., also known as AIG, is an American multinational finance and insurance corporation with operations in more than 80 countries and jurisdictions. The company operates through three core businesses: General Insurance, Life & Retirement, and a standalone technology-enabled subsidiary.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AMT', 'American Tower Corp', 'American Tower Corporation (also referred to as American Tower or ATC) is an American real estate investment trust and an owner and operator of wireless and broadcast communications infrastructure in several countries worldwide and is headquartered in Boston, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AWK', 'American Water Works', 'American Water is an American public utility company operating in the United States and Canada.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AMP', 'Ameriprise Financial Inc', 'Ameriprise Financial, Inc. is a diversified financial services company and bank holding company incorporated in Delaware and headquartered in Minneapolis, Minnesota. It provides financial planning products and services, including wealth management, asset management, insurance, annuities, and estate planning.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ABC', 'AmerisourceBergen', 'AmerisourceBergen Corporation is an American drug wholesale company that was formed by the merger of Bergen Brunswig and AmeriSource in 2001.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AME', 'Ametek Inc', 'AMETEK, Inc. is an American global manufacturer of electronic instruments and electromechanical devices with a headquarters in the United States and over 220 manufacturing sites worldwide.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AMGN', 'Amgen Inc', 'Amgen Inc. (formerly Applied Molecular Genetics Inc.) is an American multinational biopharmaceutical company headquartered in Thousand Oaks, California. Focused on molecular biology and biochemistry, its goal is to provide a healthcare business based on recombinant DNA technology.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'APH', 'Amphenol Corporation', 'Amphenol Corporation is a major producer of electronic and fiber optic connectors, cable and interconnect systems such as coaxial cables. Amphenol is a portmanteau from the corporations original name, American Phenolic Corp.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ADI', 'Analog Devices Inc', 'Analog Devices, Inc. (ADI), also known simply as Analog, is an American multinational semiconductor company specializing in data conversion, signal processing and power management technology, headquartered in Wilmington, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ANSS', 'ANSYS Inc', 'Ansys, Inc. is an American company based in Canonsburg, Pennsylvania. It develops and markets multiphysics engineering simulation software for product design, testing and operation and offers its products and services to customers worldwide.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AON', 'Aon PLC', 'Aon plc is a multinational professional services firm that sells a range of financial risk-mitigation products, including insurance, pension administration, and health-insurance plans.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'APA', 'APA Corporation', 'APA Corporation is the holding company for Apache Corporation, a company engaged in hydrocarbon exploration. It is organized in Delaware and headquartered in Houston.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AAPL', 'Apple Inc', 'Apple Inc. is an American multinational technology company that specializes in consumer electronics, computer software, and online services. Apple is the worlds largest technology company by revenue (totalling $274.5 billion in 2020) and, since January 2021, the worlds most valuable company. As of 2021, Apple is the worlds fourth-largest PC vendor by unit sales, and fourth-largest smartphone manufacturer. It is one of the Big Five American information technology companies, along with Amazon, Google, Microsoft, and Facebook.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AMAT', 'Applied Materials Inc', 'Applied Materials, Inc. is an American corporation that supplies equipment, services and software for the manufacture of semiconductor (integrated circuit) chips for electronics, flat panel displays for computers, smartphones and televisions, and solar products. The company also supplies equipment to produce coatings for flexible electronics, packaging and other applications. The company is headquartered in Santa Clara, California, in Silicon Valley.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'APTV', 'Aptiv PLC', 'Aptiv plc is an auto parts company headquartered in Dublin, Ireland.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ANET', 'Arista Networks', 'Arista Networks (formerly Arastra) is an American computer networking company headquartered in Santa Clara, California. The company designs and sells multilayer network switches to deliver software-defined networking (SDN) solutions for large datacenter, cloud computing, high-performance computing, and high-frequency trading environments.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AJG', 'Arthur J Gallagher & Co', 'Arthur J. Gallagher & Co. (AJG) is an American global insurance brokerage and risk management services firm headquartered in Rolling Meadows, Illinois.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AIZ', 'Assurant Inc', 'Assurant, Inc. is a global provider of risk management products and services with headquarters in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'T', 'AT&T Inc', 'AT&T Inc. is an American multinational conglomerate holding company, Delaware-registered but headquartered at Whitacre Tower in Downtown Dallas, Texas. It is the world largest telecommunications company, and the second largest provider of mobile telephone services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ATO', 'Atmos Energy Corporation', 'Atmos Energy Corporation, headquartered in Dallas, Texas, is one of the United States largest natural-gas-only distributors.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ADSK', 'Autodesk Inc', 'Autodesk, Inc. is an American multinational software corporation that makes software products and services for the architecture, engineering, construction, manufacturing, media, education, and entertainment industries. Autodesk is headquartered in San Rafael, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ADP', 'Automatic Data Processing Inc', 'Automatic Data Processing, Inc. (ADP) is an American provider of human resources management software and services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AZO', 'AutoZone Inc', 'AutoZone, Inc. is an American retailer of aftermarket automotive parts and accessories, the largest in the United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AVB', 'AvalonBay Communities Inc', 'AvalonBay Communities, Inc. is a publicly traded real estate investment trust that invests in apartments.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AVY', 'Avery Dennison Corp', 'Avery Dennison Corporation is a multinational manufacturer and distributor of pressure-sensitive adhesive materials (such as self-adhesive labels), apparel branding labels and tags, RFID inlays, and specialty medical products. The company is headquartered in Glendale, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BKR', 'Baker Hughes Co', 'Baker Hughes Company is an American international industrial service company and one of the worlds largest oil field services companies. The company provides the oil and gas industry with products and services for oil drilling, formation evaluation, completion, production and reservoir consulting. Baker Hughes is headquartered in Houston.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BAC', 'Bank of America Corp', 'The Bank of America Corporation is an American multinational investment bank and financial services holding company headquartered in Charlotte, North Carolina. Founded in San Francisco, Bank of America was formed through NationsBanks acquisition of BankAmerica in 1998. It is the second largest banking institution in the United States, after JPMorgan Chase, and the eighth largest bank in the world. Bank of America is one of the Big Four banking institutions of the United States. It services approximately 10 percent of all American bank deposits, in direct competition with JPMorgan Chase, Citigroup and Wells Fargo. Its primary financial services revolve around commercial banking, wealth management, and investment banking.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BBWI', 'Bath & Body Works Inc.', 'None');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BAX', 'Baxter International Inc', 'Baxter International Inc. is an American multinational health care company with headquarters in Deerfield, Illinois. The company primarily focuses on products to treat hemophilia, kidney disease, immune disorders and other chronic and acute medical conditions. ');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BDX', 'Becton Dickinson and Company', 'Becton, Dickinson and Company, also known as BD, is an American multinational medical technology company that manufactures and sells medical devices, instrument systems, and reagents. BD also provides consulting and analytics services in certain geographies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BBY', 'Best Buy Co Inc', 'Best Buy Co., Inc. is an American multinational consumer electronics retailer headquartered in Richfield, Minnesota.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BIO', 'Bio-Rad Laboratories Inc', 'Bio-Rad Laboratories, Inc. is an American developer and manufacturer of specialized technological products for the life science research and clinical diagnostics markets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TECH', 'Bio-Techne Corp', 'Bio-Techne Corporation develops, manufactures, and sells life science reagents, instruments, and services for the global clinical diagnostic and research markets. The company is headquartered in Minneapolis, Minnesota.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BIIB', 'Biogen Inc', 'Biogen Inc. is an American multinational biotechnology company based in Cambridge, Massachusetts, specializing in the discovery, development, and delivery of therapies for the treatment of neurological diseases to patients worldwide.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BLK', 'BlackRock Inc', 'BlackRock, Inc. is an American multinational investment management corporation based in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BK', 'Bank of New York Mellon', 'The Bank of New York Mellon Corporation, commonly known as BNY Mellon, is a multinational American investment banking services holding company headquartered in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BA', 'The Boeing Company', 'The Boeing Company is an American multinational corporation that designs, manufactures, and sells airplanes, rotorcraft, rockets, satellites, telecommunications equipment, and missiles worldwide. The company also provides leasing and product support services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BKNG', 'Booking Holdings Inc', 'Booking Holdings Inc. is an American travel technology company organized in Delaware and based in Norwalk, Connecticut, that owns and operates several travel fare aggregators and travel fare metasearch engines including namesake and flagship Booking.com, Priceline.com, Agoda.com, Kayak.com, Cheapflights, Rentalcars.com, Momondo, and OpenTable.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BWA', 'BorgWarner Inc', 'BorgWarner Inc. is an American multinational automotive supplier headquartered in Auburn Hills, Michigan.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BXP', 'Boston Properties Inc', 'Boston Properties, Inc. is a publicly traded real estate investment trust that invests in office buildings in Boston, Los Angeles, New York City, San Francisco, and Washington, D.C.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BSX', 'Boston Scientific Corp', 'Boston Scientific Corporation, doing business as Boston Scientific, is a manufacturer of medical devices used in interventional medical specialties, including interventional radiology, interventional cardiology, peripheral interventions, neuromodulation, neurovascular intervention, electrophysiology, cardiac surgery, vascular surgery, endoscopy, oncology, urology and gynecology.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BMY', 'Bristol-Myers Squibb Company', 'Bristol Myers Squibb (BMS) is an American multinational pharmaceutical company, headquartered in New York City. Bristol Myers Squibb manufactures prescription pharmaceuticals and biologics in several therapeutic areas, including cancer, AIDS, cardiovascular disease, diabetes, hepatitis, rheumatoid arthritis and psychiatric disorders.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'AVGO', 'Broadcom Inc', 'Broadcom Inc. is an American designer, developer, manufacturer and global supplier of a wide range of semiconductor and infrastructure software products. Broadcoms product offerings serve the data center, networking, software, broadband, wireless, and storage and industrial markets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BR', 'Broadridge Financial Solutions Inc', 'Broadridge Financial Solutions is a public corporate services company founded in 2007 as a spin-off from Automatic Data Processing. The main business of Broadridge is as a service provider supplying public companies with proxy statements, annual reports and other financial documents, and shareholder communications solutions, such as virtual annual meetings.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BRO', 'Brown & Brown Inc', 'Brown & Brown, Inc. markets and sells insurance products and services in the United States, Bermuda, Canada, the Cayman Islands, Ireland, and the United Kingdom. The company is headquartered in Daytona Beach, Florida.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CHRW', 'CH Robinson Worldwide Inc', 'C.H. Robinson is an American Fortune 500 provider of multimodal transportation services and third-party logistics (3PL). The company offers freight transportation, transportation management, brokerage and warehousing. It offers truckload, less than truckload, air freight, intermodal, and ocean transportation.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CDNS', 'Cadence Design Systems Inc', 'Cadence Design Systems, Inc., headquartered in San Jose, California, is an American multinational computational software company. The company produces software, hardware and silicon structures for designing integrated circuits, systems on chips (SoCs) and printed circuit boards.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CZR', 'Caesars Entertainment Corporation', 'Caesars Entertainment, Inc., formerly Eldorado Resorts, Inc., is an American hotel and casino entertainment company founded and based in Reno, Nevada, that operates more than 50 properties.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CPB', 'Campbell Soup Company', 'Campbell Soup Company, doing business as Campbells, is an American processed food and snack company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'COF', 'Capital One Financial Corporation', 'Capital One Financial Corporation is an American bank holding company specializing in credit cards, auto loans, banking, and savings accounts, headquartered in McLean, Virginia with operations primarily in the United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CAH', 'Cardinal Health Inc', 'Cardinal Health, Inc. is an American multinational health care services company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KMX', 'CarMax Inc', 'CarMax is a used vehicle retailer based in the United States. It operates two business segments: CarMax Sales Operations and CarMax Auto Finance.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CCL', 'Carnival Corporation', 'Carnival Corporation & plc is a British-American cruise operator, currently the worlds largest travel leisure company, with a combined fleet of over 100 vessels across 10 cruise line brands.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CARR', 'Carrier Global Corp', 'Carrier Global Corporation is an American multinational home appliances corporation based in Palm Beach Gardens, Florida.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CTLT', 'Catalent Inc', 'Catalent, Inc. (Catalent Pharma Solutions) is a multinational corporation headquartered in Somerset, New Jersey. It is a global provider of delivery technologies, development, drug manufacturing, biologics, gene therapies and consumer health products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CAT', 'Caterpillar Inc', 'Caterpillar Inc. (often shortened to CAT) is an American Fortune 100 corporation that designs, develops, engineers, manufactures, markets, and sells machinery, engines, financial products, and insurance to customers via a worldwide dealer network.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CBOE', 'Cboe Global Markets Inc', 'Cboe Global Markets is an American company that owns the Chicago Board Options Exchange and the stock exchange operator BATS Global Markets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CBRE', 'CBRE Group Inc Class A', 'CBRE Group, Inc. is an American commercial real estate services and investment firm. The abbreviation CBRE stands for Coldwell Banker Richard Ellis. It is the largest commercial real estate services company in the world.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CDW', 'CDW Corp', 'CDW Corporation, headquartered in Lincolnshire, Illinois, is a provider of technology products and services for business, government and education.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CE', 'Celanese Corporation', 'Celanese Corporation is a Fortune 500 global technology and specialty materials company headquartered in Irving, Texas, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CNC', 'Centene Corp', 'Centene Corporation is a large publicly traded company and a multi-line managed care enterprise that serves as a major intermediary for both government-sponsored and privately insured health care programs. It is a healthcare insurer that focuses on managed care for uninsured, underinsured, and low-income individuals.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CNP', 'CenterPoint Energy Inc', 'CenterPoint Energy, Inc. is an American Fortune 500 electric and natural gas utility serving several markets in the American states of Arkansas, Indiana, Louisiana, Minnesota, Mississippi, Oklahoma, and Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CDAY', 'Ceridian HCM Holding Inc', 'Ceridian HCM Holding Inc., is a Human Capital Management (HCM) software company in the United States, Canada, and internationally. The company is headquartered in Minneapolis, Minnesota.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CF', 'CF Industries Holdings Inc', 'CF Industries Holdings, Inc. is a North American manufacturer and distributor of agricultural fertilizers, based in Deerfield, Illinois.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CRL', 'Charles River Laboratories', 'Charles River Laboratories International, Inc., is an American pharmaceutical company specializing in a variety of preclinical and clinical laboratory, gene therapy and cell therapy services for the Pharmaceutical, Medical device and Biotechnology industries. It also supplies assorted biomedical products and outsourcing services for research and development in the pharmaceutical industry and offer support in the fields of basic research, drug discovery, safety and efficacy, clinical support, and manufacturing.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SCHW', 'Charles Schwab Corp', 'The Charles Schwab Corporation is an American multinational financial services company. It offers banking, commercial banking, an electronic trading platform, and wealth management advisory services to both retail and institutional clients.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CHTR', 'Charter Communications Inc', 'Charter Communications, Inc., is an American telecommunications and mass media company with services branded as Charter Spectrum.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CVX', 'Chevron Corp', 'Chevron Corporation is an American multinational energy corporation. One of the successor companies of Standard Oil, it is headquartered in San Ramon, California, and active in more than 180 countries. Chevron is engaged in every aspect of the oil and natural gas industries, including hydrocarbon exploration and production; refining, marketing and transport; chemicals manufacturing and sales; and power generation.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CMG', 'Chipotle Mexican Grill Inc', 'Chipotle Mexican Grill, Inc., often known simply as Chipotle, is an American chain of fast casual restaurants in the United States, United Kingdom, Canada, Germany, and France, specializing in tacos and Mission burritos that are made to order in front of the customer.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CB', 'Chubb Ltd', 'Chubb Limited, incorporated in Zurich, Switzerland, is the parent company of Chubb, a global provider of insurance products covering property and casualty, accident and health, reinsurance, and life insurance and the largest publicly traded property and casualty company in the world.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CHD', 'Church & Dwight Company Inc', 'Church & Dwight Co., Inc., is a major American manufacturer of household products that is headquartered in Ewing, New Jersey.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CI', 'Cigna Corp', 'Cigna is an American multinational managed healthcare and insurance company based in Bloomfield, Connecticut. Its insurance subsidiaries are major providers of medical, dental, disability, life and accident insurance and related products and services, the majority of which are offered through employers and other groups (e.g. governmental and non-governmental organizations, unions and associations).');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CINF', 'Cincinnati Financial Corporation', 'Cincinnati Financial Corporation offers property and casualty insurance, its main business, through The Cincinnati Insurance Company, The Cincinnati Indemnity Company and The Cincinnati Casualty Company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CTAS', 'Cintas Corporation', 'Cintas Corporation is an American corporation headquartered in Cincinnati, Ohio, which provides a range of products and services to businesses including uniforms, mats, mops, cleaning and restroom supplies, first aid and safety products, fire extinguishers and testing, and safety courses.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CSCO', 'Cisco Systems Inc', 'Cisco Systems, Inc. is an American multinational technology conglomerate headquartered in San Jose, California, in the center of Silicon Valley. Cisco develops, manufactures and sells networking hardware, software, telecommunications equipment and other high-technology services and products. Through its numerous acquired subsidiaries, such as OpenDNS, Webex, Jabber and Jasper, Cisco specializes in specific tech markets, such as the Internet of Things (IoT), domain security and energy management. On January 25, 2021, Cisco reincorporated in Delaware.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'C', 'Citigroup Inc', 'Citigroup Inc. is an American multinational investment bank and financial services corporation headquartered in New York City. The company was formed by the merger of banking giant Citicorp and financial conglomerate Travelers Group in 1998; Travelers was subsequently spun off from the company in 2002. Citigroup owns Citicorp, the holding company for Citibank, as well as several international subsidiaries. Citigroup is incorporated in Delaware.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CFG', 'Citizens Financial Group Inc', 'Citizens Financial Group, Inc. is an American bank headquartered in Providence, Rhode Island.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CLX', 'The Clorox Company', 'The Clorox Company, based in Oakland, California, is an American global manufacturer and marketer of consumer and professional products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CME', 'CME Group Inc', 'CME Group Inc. (Chicago Mercantile Exchange, Chicago Board of Trade, New York Mercantile Exchange, The Commodity Exchange) is an American global markets company. It is the worlds largest financial derivatives exchange, and trades in asset classes that include agricultural products, currencies, energy, interest rates, metals, stock indexes and cryptocurrencies futures.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CMS', 'CMS Energy Corporation', 'CMS Energy (NYSE: CMS), based in Jackson, Michigan, is an energy company that is focused principally on utility operations in Michigan.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KO', 'The Coca-Cola Company', 'The Coca-Cola Company is an American multinational beverage corporation incorporated under Delawares General Corporation Law and headquartered in Atlanta, Georgia. The Coca-Cola Company has interests in the manufacturing, retailing, and marketing of nonalcoholic beverage concentrates and syrups.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CTSH', 'Cognizant Technology Solutions Corp Class A', 'Cognizant is an American multinational technology company that provides business consulting, information technology and outsourcing services. It is headquartered in Teaneck, New Jersey, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CL', 'Colgate-Palmolive Company', 'Colgate-Palmolive Company is an American multinational consumer products company headquartered on Park Avenue in Midtown Manhattan, New York City. It specializes in the production, distribution and provision of household, health care, personal care and veterinary products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CMCSA', 'Comcast Corp', 'Comcast Corporation is an American telecommunications conglomerate headquartered in Philadelphia, Pennsylvania. It is the second-largest broadcasting and cable television company in the world by revenue (behind AT&T), the largest pay-TV company, the largest cable TV company and largest home Internet service provider in the United States, and the nations third-largest home telephone service provider. Comcast provides services to U.S. residential and commercial customers in 40 states and in the District of Columbia. As the parent company of the international media company NBCUniversal since 2011, Comcast is a producer of feature films and television programs intended for theatrical exhibition and over-the-air and cable television broadcast, respectively.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CMA', 'Comerica Inc', 'Comerica Incorporated is a financial services company headquartered in Dallas, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CAG', 'ConAgra Foods Inc', 'Conagra Brands, Inc. (formerly ConAgra Foods) is an American consumer packaged goods holding company headquartered in Chicago, Illinois. Conagra makes and sells products under various brand names that are available in supermarkets, restaurants, and food service establishments.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'COP', 'ConocoPhillips', 'ConocoPhillips is an American multinational corporation engaged in hydrocarbon exploration. It is based in the Energy Corridor district of Houston, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ED', 'Consolidated Edison Inc', 'Consolidated Edison, Inc., commonly known as Con Edison (stylized as conEdison) or ConEd, is one of the largest investor-owned energy companies in the United States, with approximately $12 billion in annual revenues as of 2017, and over $48 billion in assets. The company provides a wide range of energy-related products and services to its customers through its subsidiaries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'STZ', 'Constellation Brands Inc Class A', 'Constellation Brands, Inc., headquartered in Victor, New York, is an American producer and marketer of beer, wine, and spirits.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CPRT', 'Copart Inc', 'Copart, Inc. or simply Copart is a global provider of online vehicle auction and remarketing services to automotive resellers such as insurance, rental car, fleet and finance companies in 11 countries: the US, Canada, the UK, Germany, Ireland, Brazil, Spain, Dubai, Bahrain, Oman and Finland.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GLW', 'Corning Incorporated', 'Corning Incorporated is an American multinational technology company that specializes in specialty glass, ceramics, and related materials and technologies including advanced optics, primarily for industrial and scientific applications.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CTVA', 'Corteva Inc', 'Corteva, Inc. (also known as Corteva Agriscience) is a major American agricultural chemical and seed company that was the agricultural unit of DowDuPont prior to being spun off as an independent public company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'COST', 'Costco Wholesale Corp', 'Costco Wholesale Corporation (doing business as Costco Wholesale and also known simply as Costco) is an American multinational corporation which operates a chain of membership-only (needing a membership to shop there) big-box retail stores. As of 2020, Costco was the fifth largest retailer in the world, and the worlds largest retailer of choice and prime beef, organic foods, rotisserie chicken, and wine as of 2016.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CTRA', 'Coterra Energy Inc', 'Coterra Energy Inc., an independent oil and gas company, explores, exploits, develops, produces and markets oil and gas properties in the United States. The company is headquartered in Houston, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CCI', 'Crown Castle', 'Crown Castle is a real estate investment trust and provider of shared communications infrastructure in the United States. Its network includes over 40,000 cell towers and nearly 80,000 route miles of fiber supporting small cells and fiber solutions. Headquartered in Houston, Texas, the company has 100 offices nationwide.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CSX', 'CSX Corporation', 'CSX Corporation is an American holding company focused on rail transportation and real estate in North America, among other industries. Based in Richmond, Virginia, USA after the merger, in 2003 the CSX Corporation headquarters moved to Jacksonville, Florida.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CMI', 'Cummins Inc', 'Cummins is a Columbus, Indiana based multinational corporation that designs, manufactures, and distributes engines, filtration, and power generation products. Cummins also services engines and related equipment, including fuel systems, controls, air handling, filtration, emission control, electrical power generation systems, and trucks.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CVS', 'CVS Health Corp', 'CVS Health (previously CVS Corporation and CVS Caremark Corporation) is an American healthcare company that owns CVS Pharmacy, a retail pharmacy chain; CVS Caremark, a pharmacy benefits manager; Aetna, a health insurance provider, among many other brands. The companys headquarters is in Woonsocket, Rhode Island.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DHI', 'DR Horton Inc', 'D.R. Horton, Inc. is a home construction company incorporated in Delaware and headquartered in Arlington, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DHR', 'Danaher Corporation', 'Danaher Corporation is an American globally diversified conglomerate with its headquarters in Washington, D.C.. The company designs, manufactures, and markets professional, medical, industrial, and commercial products and services. The companys 3 platforms are Life Sciences, Diagnostics, and Environmental & Applied Solutions.');
