insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DE', 'Deere & Company', 'John Deere is the brand name of Deere & Company, an American corporation that manufactures agricultural, construction, and forestry machinery, diesel engines, drivetrains (axles, transmissions, gearboxes) used in heavy equipment, and lawn care equipment.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DAL', 'Delta Air Lines Inc', 'Delta Air Lines, Inc., typically referred to as Delta, is one of the major airlines of the United States and a legacy carrier. It is headquartered in Atlanta, Georgia.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'XRAY', 'Dentsply Sirona Inc', 'Dentsply Sirona is an American dental equipment manufacturer and dental consumables producer that markets its products in over 120 countries.');
