insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DXCM', 'DexCom Inc', 'DexCom, Inc. is a company that develops, manufactures, and distributes continuous glucose monitoring (CGM) systems for diabetes management. It operates internationally with headquarters in San Diego, California, and has a manufacturing facility in Mesa, Arizona.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FANG', 'Diamondback Energy Inc', 'Diamondback Energy is a company engaged in hydrocarbon exploration and headquartered in Midland, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DLR', 'Digital Realty Trust Inc', 'Digital Realty Trust, Inc. is a real estate investment trust that invests in carrier-neutral data centers and provides colocation and peering services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DFS', 'Discover Financial Services', 'Discover Financial Services is an American financial services company that owns and operates Discover Bank, which offers checking and savings accounts, personal loans, home equity loans, student loans and credit cards. It also owns and operates the Discover and Pulse networks, and owns Diners Club International. Discover is currently headquartered in the Chicago suburb of Riverwoods, Illinois.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DISH', 'DISH Network Corporation', 'DISH Network Corporation is an American television provider and the owner of the direct-broadcast satellite provider DISH, commonly known as DISH Network, and the over-the-top IPTV service, Sling TV.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DG', 'Dollar General Corporation', 'Dollar General Corporation is an American chain of variety stores headquartered in Goodlettsville, Tennessee.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DLTR', 'Dollar Tree Inc', 'Dollar Tree is an American chain of discount variety stores that sells items for $1 or less, headquartered in Chesapeake, Virginia.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'D', 'Dominion Energy Inc', 'Dominion Energy, Inc., commonly referred to as Dominion, is an American power and energy company headquartered in Richmond, Virginia that supplies electricity in parts of Virginia, North Carolina, and South Carolina and supplies natural gas to parts of Utah, West Virginia, Ohio, Pennsylvania, North Carolina, South Carolina, and Georgia. Dominion also has generation facilities in Indiana, Illinois, Connecticut, and Rhode Island.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DPZ', 'Domino’s Pizza Inc', 'Dominos Pizza, Inc., branded as Dominos, is an American multinational pizza restaurant chain founded in 1960. The corporation is headquartered at the Dominos Farms Office Park in Ann Arbor, Michigan.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DOV', 'Dover Corporation', 'Dover Corporation is an American conglomerate manufacturer of industrial products. Founded in 1955 in New York City, Dover is now based in Downers Grove, Illinois.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DOW', 'Dow Inc', 'Dow Inc. is an American commodity chemical company. The company is headquartered in Midland, Michigan.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DTE', 'DTE Energy Company', 'DTE Energy (formerly Detroit Edison until 1996) is a Detroit-based diversified energy company involved in the development and management of energy-related businesses and services in the United States and Canada.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DUK', 'Duke Energy Corporation', 'Duke Energy Corporation is an American electric power and natural gas holding company headquartered in Charlotte, North Carolina.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DD', 'Dupont De Nemours Inc', 'DuPont de Nemours, Inc., commonly known as DuPont, is an American company formed by the merger of Dow Chemical and E. I. du Pont de Nemours and Company on August 31, 2017, and the subsequent spinoffs of Dow Inc. and Corteva. Prior to the spinoffs it was the worlds largest chemical company in terms of sales.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DXC', 'DXC Technology Co', 'DXC Technology is an American multinational corporation that provides business-to-business information technology services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EMN', 'Eastman Chemical Company', 'Eastman Chemical Company is an American company primarily involved in the chemical industry. Once a subsidiary of Kodak, today it is an independent global specialty materials company that produces a broad range of advanced materials, chemicals and fibers for everyday purposes. The company is headquartered in Kingsport, Tennessee.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ETN', 'Eaton Corporation PLC', 'Eaton Corporation plc is an American Irish-domiciled multinational power management company with 2020 sales of 17.86 billion USD, founded in the United States with corporate headquarters in Dublin, Ireland, and operational headquarters in Beachwood, Ohio.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EBAY', 'eBay Inc', 'eBay Inc. is an American multinational e-commerce corporation based in San Jose, California, that facilitates consumer-to-consumer and business-to-consumer sales through its website.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ECL', 'Ecolab Inc', 'Ecolab Inc., headquartered in St. Paul, Minnesota, is an American corporation that develops and offers services, technology and systems that specialize in water treatment, purification, cleaning and hygiene in a wide variety of applications. It helps organizations both private market as well as public treat their water, not only for drinking directly, but also for use in food, healthcare, hospitality related safety and industry.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EIX', 'Edison International', 'Edison International is a public utility holding company based in Rosemead, California. Its subsidiaries include Southern California Edison, and unregulated non-utility business assets Edison Energy.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EW', 'Edwards Lifesciences Corp', 'Edwards Lifesciences is an American medical technology company headquartered in Irvine, California, specializing in artificial heart valves and hemodynamic monitoring.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EA', 'Electronic Arts Inc', 'Electronic Arts Inc. (EA) is an American video game company headquartered in Redwood City, California. It is the second-largest gaming company in the Americas and Europe by revenue and market capitalization after Activision Blizzard and ahead of Take-Two Interactive, and Ubisoft as of May 2020.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LLY', 'Eli Lilly and Company', 'Eli Lilly and Company is an American pharmaceutical company headquartered in Indianapolis, Indiana, with offices in 18 countries. Its products are sold in approximately 125 countries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EMR', 'Emerson Electric Company', 'Emerson Electric Co. is an American multinational corporation headquartered in Ferguson, Missouri. The Fortune 500 company manufactures products and provides engineering services for a wide range of industrial, commercial, and consumer markets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ENPH', 'Enphase Energy Inc', 'Enphase Energy is an American energy technology company headquartered in Fremont, California. Enphase designs and manufactures software-driven home energy solutions that span solar generation, home energy storage and web-based monitoring and control.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ETR', 'Entergy Corporation', 'Entergy Corporation is a Fortune 500 integrated energy company engaged primarily in electric power production and retail distribution operations in the Deep South of the United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EOG', 'EOG Resources Inc', 'EOG Resources, Inc. is an American energy company engaged in hydrocarbon exploration. It is organized in Delaware and headquartered in the Heritage Plaza building in Houston, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EFX', 'Equifax Inc', 'Equifax Inc. is an American multinational consumer credit reporting agency and is one of the three largest consumer credit reporting agencies, along with Experian and TransUnion. In addition to credit and demographic data and services to business, Equifax sells credit monitoring and fraud prevention services directly to consumers.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EQIX', 'Equinix Inc', 'Equinix, Inc. is an American multinational company headquartered in Redwood City, California, that specializes in Internet connection and data centers.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EQR', 'Equity Residential', 'Equity Residential is a publicly traded real estate investment trust that invests in apartments.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ESS', 'Essex Property Trust Inc', 'Essex Property Trust is a publicly traded real estate investment trust that invests in apartments, primarily on the West Coast of the United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EL', 'Estee Lauder Companies Inc', 'The Estee Lauder Companies Inc. is an American multinational manufacturer and marketer of prestige skincare, makeup, fragrance and hair care products, based in Midtown Manhattan, New York City. The company owns a diverse portfolio of brands, distributed internationally through both digital commerce and retail channels.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ETSY', 'Etsy Inc', 'Etsy, Inc. is an American e-commerce company focused on handmade or vintage items and craft supplies. These items fall under a wide range of categories, including jewelry, bags, clothing, home decor and furniture, toys, art, as well as craft supplies and tools.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RE', 'Everest Re Group Ltd', 'Everest Re Group is a reinsurance company based in Hamilton, Bermuda.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EVRG', 'Evergy Inc. Common Stock', 'Evergy is an American investor-owned utility (IOU) with publicly traded stock that has its headquarters in Topeka, Kansas, and in Kansas City, Missouri.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ES', 'Eversource Energy', 'Eversource Energy is a publicly traded, Fortune 500 energy company headquartered in Hartford, Connecticut, and Boston, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EXC', 'Exelon Corporation', 'Exelon Corporation is an American Fortune 100 energy company headquartered in Chicago, Illinois and incorporated in Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EXPE', 'Expedia Group Inc.', 'Expedia Group, Inc. is an American online travel shopping company for consumer and small business travel. Its websites, which are primarily travel fare aggregators and travel metasearch engines, include Expedia.com, Vrbo (previously HomeAway), Hotels.com, Hotwire.com, Orbitz, Travelocity, trivago and CarRentals.com.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EXPD', 'Expeditors International of Washington Inc', 'Expeditors (Expeditors International of Washington) is an American worldwide logistics and freight forwarding company headquartered in Seattle, Washington.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'EXR', 'Extra Space Storage Inc', 'Extra Space Storage is a real estate investment trust headquartered in Cottonwood Heights, Utah that invests in self storage units.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'XOM', 'Exxon Mobil Corp', 'Exxon Mobil Corporation, stylized as ExxonMobil, is an American multinational oil and gas corporation headquartered in Irving, Texas. It is the largest direct descendant of John D. Rockefellers Standard Oil, and was formed on November 30, 1999 by the merger of Exxon (formerly the Standard Oil Company of New Jersey) and Mobil (formerly the Standard Oil Company of New York). ExxonMobils primary brands are Exxon, Mobil, Esso, and ExxonMobil Chemical. ExxonMobil is incorporated in New Jersey.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FFIV', 'F5 Networks Inc', 'F5, Inc. is an American company that specializes in application delivery networking (ADN), application availability & performance, multi-cloud management, application security, network security, access & authorization and online fraud prevention. F5 is headquartered in Seattle, Washington, with additional development, manufacturing, and administrative offices worldwide.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FAST', 'Fastenal Company', 'Fastenal Company is an American company based in Winona, Minnesota. Fastenals service model centers on approximately 3,200 in-market locations, each providing custom inventory, and a dedicated sales team to support local businesses. Fastenal offers companies supply chain solutions that help business reduce inventory touches, and supply chain waste.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FRT', 'Federal Realty Investment Trust', 'Federal Realty Investment Trust is a real estate investment trust that invests in shopping centers in the Northeastern United States, the Mid-Atlantic states, California, and South Florida.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FDX', 'FedEx Corporation', 'FedEx Corporation, formerly Federal Express Corporation and later FDX Corporation, is an American multinational delivery services company headquartered in Memphis, Tennessee.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FIS', 'Fidelity National Information Services Inc', 'FIS is an American Fortune 500 company which offers a wide range of financial products and services. Headquartered in Jacksonville, Florida, FIS employs approximately 63,000 people worldwide. FIS is most known for its development of Financial Technology, or FinTech, and as of Q2 2020 it offers its solutions in three primary segments: Merchant Solutions, Banking Solutions, and Capital Market Solutions.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FITB', 'Fifth Third Bancorp', 'Fifth Third Bank is a bank headquartered in Cincinnati, Ohio, at Fifth Third Center. It is the principal subsidiary of Fifth Third Bancorp, a diversified bank holding company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FE', 'FirstEnergy Corporation', 'FirstEnergy Corp is an electric utility headquartered in Akron, Ohio. Its subsidiaries and affiliates are involved in the distribution, transmission, and generation of electricity, as well as energy management and other energy-related services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FLT', 'Fleetcor Technologies Inc', 'FleetCor Technologies, Inc. or FLEETCOR provides fuel cards and workforce payment products and services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FMC', 'FMC Corporation', 'FMC Corporation (Food Machinery and Chemical Corporation) is an American chemical manufacturing company headquartered in Philadelphia, Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'F', 'Ford Motor Company', 'Ford Motor Company, commonly known as Ford, is an American multinational automaker that has its main headquarters in Dearborn, Michigan.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FTNT', 'Fortinet Inc', 'Fortinet (Nasdaq: FTNT) is an American multinational corporation headquartered in Sunnyvale, California. It develops and sells cybersecurity solutions, including but not limited to physical products such as firewalls, plus software and services such as anti-virus protection, intrusion prevention systems and endpoint security components.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FTV', 'Fortive Corp', 'Fortive is an American diversified industrial technology conglomerate company headquartered in Everett, Washington.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FOXA', 'Fox Corp Class A', 'Fox Corporation is an American mass media company headquartered in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FOX', 'Fox Corp Class B', 'Fox Corporation is an American mass media company headquartered in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'BEN', 'Franklin Resources Inc', 'Franklin Resources Inc. is an American multinational holding company that, together with its subsidiaries, is referred to as Franklin Templeton; it is a global investment firm founded in New York City in 1947 as Franklin Distributors, Inc.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'FCX', 'Freeport-McMoran Copper & Gold Inc', 'Freeport-McMoRan Inc., often called Freeport, is an American mining company based in the Freeport-McMoRan Center, in Phoenix, Arizona.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GPS', 'Gap Inc', 'The Gap, Inc., commonly known as Gap Inc. or Gap, is an American worldwide clothing and accessories retailer.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GRMN', 'Garmin Ltd', 'Garmin Ltd. is an American multinational technology company with headquarters in Olathe, Kansas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IT', 'Gartner Inc', 'Gartner, Inc, officially known as Gartner, is a global research and advisory firm providing information, advice, and tools for leaders in IT, finance, HR, customer service and support, communications, legal and compliance, marketing, sales, and supply chain functions. Its headquarters are in Stamford, Connecticut, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GNRC', 'Generac Holdings Inc', 'Generac Holdings Inc., commonly referred to as Generac, is a Fortune 1000 American manufacturer of backup power generation products for residential, light commercial and industrial markets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GD', 'General Dynamics Corporation', 'General Dynamics Corporation (GD) is an American aerospace and defense corporation. It is headquartered in Reston, Fairfax County, Virginia.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GE', 'General Electric Company', 'General Electric Company (GE) is an American multinational conglomerate incorporated in New York City and headquartered in Boston. As of 2018, the company operates through the following segments: aviation, healthcare, power, renewable energy, digital industry, additive manufacturing and venture capital and finance.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GIS', 'General Mills Inc', 'General Mills, Inc., is an American multinational manufacturer and marketer of branded consumer foods sold through retail stores. It is headquartered in Golden Valley, Minnesota, a suburb of Minneapolis.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GM', 'General Motors Company', 'General Motors Company (GM) is an American multinational corporation headquartered in Detroit, Michigan that designs, manufactures, markets, and distributes vehicles and vehicle parts, and sells financial services, with global headquarters in Detroits Renaissance Center.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GPC', 'Genuine Parts Co', 'Genuine Parts Company (GPC) is an American service organization engaged in the distribution of automotive replacement parts, industrial replacement parts, office products and electrical/electronic materials.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GILD', 'Gilead Sciences Inc', 'Gilead Sciences, Inc. is an American biopharmaceutical company headquartered in Foster City, California, that focuses on researching and developing antiviral drugs used in the treatment of HIV, hepatitis B, hepatitis C, and influenza, including Harvoni and Sovaldi.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GPN', 'Global Payments Inc', 'Global Payments Inc. is an American company providing financial technology services globally headquartered in Atlanta, Georgia.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GL', 'Globe Life Inc', 'Globe Life is a financial services holding company that operates through its wholly owned subsidiaries providing life insurance, annuity, and supplemental health insurance products. The company is based in McKinney, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GS', 'Goldman Sachs Group Inc', 'The Goldman Sachs Group, Inc., is an American multinational investment bank and financial services company headquartered in New York City. It offers services in investment management, securities, asset management, prime brokerage, and securities underwriting. It also provides investment banking to institutional investors.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HAL', 'Halliburton Company', 'Halliburton Company is an American multinational corporation. One of the worlds largest oil field service companies, it has operations in more than 70 countries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HBI', 'Hanesbrands Inc', 'Hanesbrands Inc. is an American multinational clothing company based in Winston-Salem, North Carolina.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HAS', 'Hasbro Inc', 'Hasbro, Inc. is an American multinational conglomerate with toy, board game, and media assets, headquartered in Pawtucket, Rhode Island.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HCA', 'HCA Holdings Inc', 'HCA Healthcare is an American for-profit operator of health care facilities that was founded in 1968. It is based in Nashville, Tennessee, and, as of May 2020, owns and operates 186 hospitals and approximately 2,000 sites of care, including surgery centers, freestanding emergency rooms, urgent care centers and physician clinics in 21 states and the United Kingdom.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PEAK', 'Healthpeak Properties Inc', 'Healthpeak Properties, Inc. is a real estate investment trust that invests in real estate related to the healthcare industry including senior housing, life science, and medical offices. It is organized in Maryland and headquartered in Denver, Colorado.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HSIC', 'Henry Schein Inc', 'Henry Schein, Inc. is an American distributor of health care products and services with a presence in 32 countries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HES', 'Hess Corporation', 'Hess Corporation (formerly Amerada Hess Corporation) is an American global independent energy company involved in the exploration and production of crude oil and natural gas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HPE', 'Hewlett Packard Enterprise Co', 'The Hewlett Packard Enterprise Company (HPE) is an American multinational enterprise information technology company based in Houston, Texas, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HLT', 'Hilton Worldwide Holdings Inc', 'Hilton Worldwide Holdings Inc., formerly Hilton Hotels Corporation, is an American multinational hospitality company that manages and franchises a broad portfolio of hotels and resorts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HOLX', 'Hologic Inc', 'Hologic, Inc. is a medical technology company primarily focused on womens health; it sells medical devices for diagnostics, surgery, and medical imaging.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HD', 'Home Depot Inc', 'The Home Depot, Inc., commonly known as Home Depot, is the largest home improvement retailer in the United States, supplying tools, construction products, and services. The company is headquartered in incorporated Cobb County, Georgia, with an Atlanta mailing address.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HON', 'Honeywell International Inc', 'Honeywell International Inc. is an American publicly traded, multinational conglomerate headquartered in Charlotte, North Carolina. It primarily operates in four areas of business: aerospace, building technologies, performance materials and technologies (PMT), and safety and productivity solutions (SPS).');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HRL', 'Hormel Foods Corporation', 'Hormel Foods Corporation is an American company founded in 1891 in Austin, Minnesota, by George A. Hormel as George A. Hormel & Company. Originally focusing on the packaging and selling of ham, Spam, sausage and other pork, chicken, beef and lamb products to consumers; by the 1980s, Hormel began offering a wider range of packaged and refrigerated foods.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HST', 'Host Hotels & Resorts Inc', 'Host Hotels & Resorts, Inc. is a real estate investment trust that invests in hotels.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HWM', 'Howmet Aerospace Inc', 'Howmet Aerospace Inc. is an American aerospace company based in Pittsburgh, Pennsylvania. The company manufactures components for jet engines, fasteners and titanium structures for aerospace applications, and forged aluminum wheels for heavy trucks.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HPQ', 'HP Inc', 'HP Inc. is an American multinational information technology company headquartered in Palo Alto, California, that develops personal computers (PCs), printers and related supplies, as well as 3D printing solutions.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HUM', 'Humana Inc', 'Humana Inc. is a for-profit American health insurance company based in Louisville, Kentucky.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HBAN', 'Huntington Bancshares Incorporated', 'Huntington Bancshares Incorporated is a bank holding company headquartered in Columbus, Ohio.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HII', 'Huntington Ingalls Industries Inc', 'Huntington Ingalls Industries (HII) is the largest military shipbuilding company in the United States as well as a provider of professional services to partners in government and industry.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IBM', 'International Business Machines', 'International Business Machines Corporation (IBM) is an American multinational technology company headquartered in Armonk, New York, with operations in over 170 countries. The company began in 1911, founded in Endicott, New York, as the Computing-Tabulating-Recording Company (CTR) and was renamed International Business Machines in 1924. IBM is incorporated in New York. IBM produces and sells computer hardware, middleware and software, and provides hosting and consulting services in areas ranging from mainframe computers to nanotechnology. IBM is also a major research organization, holding the record for most annual U.S. patents generated by a business (as of 2020) for 28 consecutive years. Inventions by IBM include the automated teller machine (ATM), the floppy disk, the hard disk drive, the magnetic stripe card, the relational database, the SQL programming language, the UPC barcode, and dynamic random-access memory (DRAM). The IBM mainframe, exemplified by the System/360, was the dominant computing platform during the 1960s and 1970s.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IEX', 'IDEX Corporation', 'IDEX Corporation, based in Northbrook, Illinois, is a publicly traded company engaged in the development, design, and manufacture of fluidics systems and specialty engineered products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IDXX', 'IDEXX Laboratories Inc', 'IDEXX Laboratories, Inc. is an American multinational corporation  engaged in the development, manufacture, and distribution of products and services for the companion animal veterinary, livestock and poultry, water testing, and dairy markets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ITW', 'Illinois Tool Works Inc', 'Illinois Tool Works Inc. or ITW is an American company that produces engineered fasteners and components, equipment and consumable systems, and specialty products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ILMN', 'Illumina Inc', 'Illumina, Inc. is an American company. Incorporated on April 1, 1998, Illumina develops, manufactures, and markets integrated systems for the analysis of genetic variation and biological function. The company provides a line of products and services that serves the sequencing, genotyping and gene expression, and proteomics markets. Its headquarters are located in San Diego, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'INCY', 'Incyte Corporation', 'Incyte Corp is an American pharmaceutical company based in Alapocas, Delaware.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IR', 'Ingersoll Rand Inc', 'Ingersoll Rand Inc., founded in 1859, is an American worldwide provider of industrial equipment, technologies and related parts and services to a broad and diverse customer base through a family of brands.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'INTC', 'Intel Corporation', 'Intel Corporation is an American multinational corporation and technology company headquartered in Santa Clara, California, in Silicon Valley. It is the worlds largest semiconductor chip manufacturer by revenue, and is the developer of the x86 series of microprocessors, the processors found in most personal computers (PCs).');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ICE', 'Intercontinental Exchange Inc', 'The Intercontinental Exchange (ICE) is an American Fortune 500 company formed in 2000 that operates global exchanges, clearing houses and provides mortgage technology, data and listing services. The company owns exchanges for financial and commodity markets, and operates regulated exchanges and marketplaces.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IFF', 'International Flavors & Fragrances Inc', 'International Flavors & Fragrances is an American corporation that produces flavors, fragrances, and cosmetic actives, which it markets globally. It is headquartered in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IP', 'International Paper', 'The International Paper Company (NYSE: IP) is an American pulp and paper company, the largest such company in the world. The company is headquartered in Memphis, Tennessee.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IPG', 'Interpublic Group of Companies Inc', 'The Interpublic Group of Companies, Inc. (IPG) is an American publicly traded advertising company. The company consists of five major networks: FCB, IPG Mediabrands, McCann Worldgroup, MullenLowe Group, and Marketing Specialists, as well as a number of independent specialty agencies in the areas of public relations, sports marketing, talent representation, and healthcare.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'INTU', 'Intuit Inc', 'Intuit Inc. is an American business that specializes in financial software. Intuits products include the tax preparation application TurboTax, personal finance app Mint and the small business accounting program QuickBooks.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ISRG', 'Intuitive Surgical Inc', 'Intuitive Surgical, Inc. is an American corporation that develops, manufactures, and markets robotic products designed to improve clinical outcomes of patients through minimally invasive surgery, most notably with the da Vinci Surgical System.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IVZ', 'Invesco Plc', 'Invesco Ltd. is an American independent investment management company that is headquartered in Atlanta, Georgia.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IPGP', 'IPG Photonics Corporation', 'IPG Photonics is a manufacturer of fiber lasers.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IQV', 'IQVIA Holdings Inc', 'IQVIA, formerly Quintiles and IMS Health, Inc., is an American multinational company serving the combined industries of health information technology and clinical research. It is a provider of biopharmaceutical development and commercial outsourcing services, focused primarily on Phase I-IV clinical trials and associated laboratory and analytical services, including consulting services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'IRM', 'Iron Mountain Incorporated', 'Iron Mountain Inc. (NYSE: IRM) is an American enterprise information management services company founded in 1951 and headquartered in Boston, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'JBHT', 'JB Hunt Transport Services Inc', 'J.B. Hunt Transport Services, Inc. is an American transportation and logistics company based in Lowell, Arkansas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'JKHY', 'Jack Henry & Associates Inc', 'Jack Henry & Associates, Inc. is a technology company and payment processing service for the financial services industry.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'J', 'Jacobs Solutions Inc.', 'Jacobs Engineering Group Inc. (NYSE: J) is an American international technical professional services firm. The company provides technical, professional and construction services, as well as scientific and specialty consulting for a broad range of clients globally, including companies, organizations, and government agencies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SJM', 'JM Smucker Company', 'The J. M. Smucker Company, also known as Smucker and Smuckers, is an American manufacturer of jam, peanut butter, jelly, fruit syrups, beverages, shortening, ice cream toppings, and other products in North America. Smuckers headquarters are located in Orrville, Ohio.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'JNJ', 'Johnson & Johnson', 'Johnson & Johnson (J&J) is an American multinational corporation founded in 1886 that develops medical devices, pharmaceuticals, and consumer packaged goods. Its common stock is a component of the Dow Jones Industrial Average and the company is ranked No. 36 on the 2021 Fortune 500 list of the largest United States corporations by total revenue. Johnson & Johnson is one of the worlds most valuable companies, and is one of only two U.S.-based companies that has a prime credit rating of AAA, higher than that of the United States government.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'JCI', 'Johnson Controls International PLC', 'Johnson Controls International plc is an Irish-domiciled multinational conglomerate headquartered in Cork, Ireland, that produces fire, HVAC, and security equipment for buildings.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'JPM', 'JPMorgan Chase & Co', 'JPMorgan Chase & Co. is an American multinational investment bank and financial services holding company headquartered in New York City. JPMorgan Chase is incorporated in Delaware. As a Bulge Bracket bank, it is a major provider of various investment banking and financial services. It is one of Americas Big Four banks, along with Bank of America, Citigroup, and Wells Fargo. JPMorgan Chase is considered to be a universal bank and a custodian bank. The J.P. Morgan brand is used by the investment banking, asset management, private banking, private wealth management, and treasury services divisions.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'JNPR', 'Juniper Networks Inc', 'Juniper Networks, Inc. is an American multinational corporation headquartered in Sunnyvale, California. The company develops and markets networking products, including routers, switches, network management software, network security products, and software-defined networking technology.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'K', 'Kellogg Company', 'The Kellogg Company, doing business as Kelloggs, is an American multinational food manufacturing company headquartered in Battle Creek, Michigan, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KEY', 'KeyCorp', 'KeyBank, the primary subsidiary of KeyCorp, is a regional bank headquartered in Cleveland.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KEYS', 'Keysight Technologies Inc', 'Keysight Technologies, or Keysight, is an American company that manufactures electronics test and measurement equipment and software.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KMB', 'Kimberly-Clark Corporation', 'Kimberly-Clark Corporation is an American multinational personal care corporation that produces mostly paper-based consumer products. The company manufactures sanitary paper products and surgical & medical instruments. Kimberly-Clark brand name products include Kleenex facial tissue, Kotex feminine hygiene products, Cottonelle, Scott and Andrex toilet paper, Wypall utility wipes, KimWipes scientific cleaning wipes and Huggies disposable diapers and baby wipes.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KIM', 'Kimco Realty Corporation', 'Kimco Realty Corporation is a real estate investment trust (REIT) that invests in shopping centers.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KMI', 'Kinder Morgan Inc', 'Kinder Morgan, Inc. is one of the largest energy infrastructure companies in North America. The company specializes in owning and controlling oil and gas pipelines and terminals.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KLAC', 'KLA-Tencor Corporation', 'KLA Corporation is a capital equipment company based in Milpitas, California. It supplies process control and yield management systems for the semiconductor industry and other related nanoelectronics industries. The companys products and services are intended for all phases of wafer, reticle, integrated circuit (IC) and packaging production, from research and development to final volume manufacturing.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KHC', 'Kraft Heinz Co', 'The Kraft Heinz Company (KHC), commonly known as Kraft Heinz, is an American food company formed by the merger of Kraft Foods and Heinz, co-headquartered in Chicago, Illinois, and Pittsburgh, Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'KR', 'Kroger Company', 'The Kroger Company, or simply Kroger, is an American retail company founded by Bernard Kroger in 1883 in Cincinnati, Ohio.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LHX', 'L3Harris Technologies Inc', 'L3Harris Technologies (L3Harris) is an American technology company, defense contractor and information technology services provider that produces C6ISR systems and products, wireless equipment, tactical radios, avionics and electronic systems, night vision equipment, and both terrestrial and spaceborne antennas for use in the government, defense, and commercial sectors.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LH', 'Laboratory Corporation of America Holdings', 'Laboratory Corporation of America Holdings, more commonly known as Labcorp, is an American company headquartered in Burlington, North Carolina. It operates one of the largest clinical laboratory networks in the world, with a United States network of 36 primary laboratories.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LRCX', 'Lam Research Corp', 'Lam Research Corporation is an American corporation that engages in the design, manufacture, marketing, and service of semiconductor processing equipment used in the fabrication of integrated circuits. Its products are used primarily in front-end wafer processing, which involves the steps that create the active components of semiconductor devices (transistors, capacitors) and their wiring (interconnects). The company also builds equipment for back-end wafer-level packaging (WLP), and for related manufacturing markets such as for microelectromechanical systems (MEMS). The company is headquartered in Fremont, California, in the Silicon Valley.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LW', 'Lamb Weston Holdings Inc', 'Lamb Weston Holdings, Inc. is an American food processing company that is one of the worlds largest producers and processors of frozen french fries and other frozen potato products. It is headquartered in Eagle, Idaho.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LVS', 'Las Vegas Sands Corp', 'Las Vegas Sands Corporation is an American casino and resort company based in Paradise, Nevada, United States. Its resorts feature accommodations, gambling and entertainment, convention and exhibition facilities, restaurants and clubs, as well as an art and science museum in Singapore.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LEG', 'Leggett & Platt Incorporated', 'Leggett & Platt (L&P), based in Carthage, Missouri, is a diversified manufacturer that designs and produces various engineered components and products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LDOS', 'Leidos Holdings Inc', 'Leidos, formerly known as Science Applications International Corporation (SAIC), is an American defense, aviation, information technology (Lockheed Martin IS&GS), and biomedical research company headquartered in Reston, Virginia, that provides scientific, engineering, systems integration, and technical services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LEN', 'Lennar Corporation', 'Lennar Corporation is a home construction and real estate company based in Fontainebleau, Florida.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LNC', 'Lincoln National Corporation', 'Lincoln National Corporation is an American holding company, which operates multiple insurance and investment management businesses through subsidiary companies. Lincoln Financial Group is the marketing name for LNC and its subsidiary companies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LIN', 'Linde PLC', 'Linde plc is a multinational chemical company. It is the largest industrial gas company by market share and revenue. It serves customers in the healthcare, petroleum refining, manufacturing, food, beverage carbonation, fiber-optics, steel making, aerospace, chemicals, electronics and water treatment industries. The companys primary business is the manufacturing and distribution of atmospheric gases, including oxygen, nitrogen, argon, rare gases, and process gases, including carbon dioxide, helium, hydrogen, electronic gases, specialty gases, and acetylene.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LYV', 'Live Nation Entertainment Inc', 'Live Nation Entertainment, Inc is an American global entertainment company, founded in 2010, following the merger of Live Nation and Ticketmaster. The company promotes, operates, and manages ticket sales for live entertainment in the United States and internationally. It also owns and operates entertainment venues, and manages the careers of music artists.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LKQ', 'LKQ Corporation', 'LKQ Corporation (Like Kind and Quality) is an American provider of alternative and speciality parts to repair and accessorise automobiles and other vehicles.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LMT', 'Lockheed Martin Corporation', 'Lockheed Martin Corporation is an American aerospace, defense, information security, and technology company with worldwide interests. It is headquartered in North Bethesda, Maryland, in the Washington, D.C., area.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'L', 'Loews Corp', 'Loews Corporation is an American conglomerate headquartered in New York City. The companys majority-stake holdings include CNA Financial Corporation, Diamond Offshore Drilling, Boardwalk Pipeline Partners, Loews Hotels and Altium Packaging.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LOW', 'Lowes Companies Inc', 'Lowes Companies, Inc. is an American retail company specializing in home improvement. Headquartered in Mooresville, North Carolina, the company operates a chain of retail stores in the United States and Canada.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LUMN', 'Lumen Technologies Inc', 'Lumen Technologies (formerly CenturyLink) is an American telecommunications company headquartered in Monroe, Louisiana, that offers communications, network services, security, cloud solutions, voice, and managed services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LYB', 'LyondellBasell Industries NV', 'LyondellBasell Industries N.V. (NYSE: LYB) is a Dutch-domiciled multinational chemical company with American and British roots, incorporated in the Netherlands, with U.S. operations headquarters in Houston, Texas, and offices in London, UK. The company is the largest licensor of polyethylene and polypropylene technologies. It also produces ethylene, propylene, polyolefins, and oxyfuels.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MTB', 'M&T Bank Corp', 'M&T Bank Corporation is an American bank holding company headquartered in Buffalo, New York.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MRO', 'Marathon Oil Corporation', 'Marathon Oil Corporation is an American company engaged in hydrocarbon exploration incorporated in Ohio and headquartered in the Marathon Oil Tower in Houston, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MPC', 'Marathon Petroleum Corp', 'Marathon Petroleum Corporation is an American petroleum refining, marketing, and transportation company headquartered in Findlay, Ohio.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MKTX', 'MarketAxess Holdings Inc', 'MarketAxess Holdings Inc. (MarketAxess) is an international financial technology company that operates an electronic trading platform for the institutional credit markets, and also provides market data and post-trade services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MAR', 'Marriott International Inc', 'Marriott International, Inc. is an American multinational company that operates, franchises, and licenses lodging including hotel, residential, and timeshare properties. It is headquartered in Bethesda, Maryland.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MMC', 'Marsh & McLennan Companies Inc', 'Marsh McLennan (formerly known as Marsh & McLennan Companies) is a global professional services firm, headquartered in New York City with businesses in insurance brokerage, risk management, reinsurance services, talent management, investment advisory, and management consulting. Its four main operating companies are Marsh, Guy Carpenter, Mercer, and Oliver Wyman.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MLM', 'Martin Marietta Materials Inc', 'Martin Marietta Materials, Inc. is an American-based company. The company is a supplier of aggregates and heavy building materials, with operations spanning 26 states, Canada and the Caribbean. In particular, Martin Marietta supplies the resources for roads, sidewalks and foundations.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MAS', 'Masco Corporation', 'Masco Corporation is a manufacturer of products for the home improvement and new home construction markets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MA', 'Mastercard Inc', 'Mastercard Incorporated is an American multinational financial services corporation headquartered in the Mastercard International Global Headquarters in Purchase, New York. The Global Operations Headquarters is located in OFallon, Missouri, a municipality of St. Charles County, Missouri. Throughout the world, its principal business is to process payments between the banks of merchants and the card-issuing banks or credit unions of the purchasers who use the Mastercard brand debit, credit and prepaid cards to make purchases. Mastercard Worldwide has been a publicly traded company since 2006.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MTCH', 'Match Group Inc', 'Match Group, Inc. offers dating products globally. The company is headquartered in Dallas, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MKC', 'McCormick & Company Incorporated', 'McCormick & Company is an American multinational food company that manufactures, markets, and distributes spices, seasoning mixes, condiments, and other flavoring products to retail outlets, food manufacturers, and foodservice businesses.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MCD', 'McDonald’s Corporation', 'McDonalds Corporation is an American fast food company, founded in 1940 as a restaurant operated by Richard and Maurice McDonald, in San Bernardino, California, United States. They rechristened their business as a hamburger stand, and later turned the company into a franchise, with the Golden Arches logo being introduced in 1953 at a location in Phoenix, Arizona.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MCK', 'McKesson Corporation', 'McKesson Corporation is an American company distributing pharmaceuticals and providing health information technology, medical supplies, and care management tools.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MDT', 'Medtronic PLC', 'Medtronic plc is an American-Irish registered medical device company that primarily operates in the United States. Medtronic has an operational and executive headquarters in Fridley, Minnesota in the US.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MRK', 'Merck & Company Inc', 'Merck & Co. is an American multinational pharmaceutical company headquartered in Kenilworth, New Jersey. It is named after the Merck family, which set up Merck Group in Germany in 1668.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MET', 'MetLife Inc', 'MetLife, Inc. is the holding corporation for the Metropolitan Life Insurance Company (MLIC), better known as MetLife, and its affiliates. MetLife is among the largest global providers of insurance, annuities, and employee benefit programs, with 90 million customers in over 60 countries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MTD', 'Mettler-Toledo International Inc', 'Mettler Toledo (NYSE: MTD) is a multinational manufacturer of scales and analytical instruments. It is the largest provider of weighing instruments for use in laboratory, industrial, and food retailing applications. The company also provides various analytical instruments, process analytics instruments, and end-of-line inspection systems.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MGM', 'MGM Resorts International', 'MGM Resorts International is an American global hospitality and entertainment company operating destination resorts globally.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MCHP', 'Microchip Technology Inc', 'Microchip Technology Inc. is a publicly-listed American corporation that manufactures microcontroller, mixed-signal, analog and Flash-IP integrated circuits.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MU', 'Micron Technology Inc', 'Micron Technology, Inc. is an American producer of computer memory and computer data storage including dynamic random-access memory, flash memory, and USB flash drives. It is headquartered in Boise, Idaho.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MSFT', 'Microsoft Corporation', 'Microsoft Corporation is an American multinational technology company which produces computer software, consumer electronics, personal computers, and related services. Its best known software products are the Microsoft Windows line of operating systems, the Microsoft Office suite, and the Internet Explorer and Edge web browsers. Its flagship hardware products are the Xbox video game consoles and the Microsoft Surface lineup of touchscreen personal computers. Microsoft ranked No. 21 in the 2020 Fortune 500 rankings of the largest United States corporations by total revenue; it was the worlds largest software maker by revenue as of 2016. It is considered one of the Big Five companies in the U.S. information technology industry, along with Google, Apple, Amazon, and Facebook.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MAA', 'Mid-America Apartment Communities Inc', 'Mid-America Apartment Communities (MAA) is a publicly traded real estate investment trust based in Memphis, Tennessee that invests in apartments in the Southeastern United States and the Southwestern United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MRNA', 'Moderna Inc', 'Moderna, Inc., a biotechnology company, develops messenger RNA-based vaccines and therapies for the treatment of infectious diseases, immuno-oncology, rare diseases, cardiovascular diseases, and autoimmune diseases. The company is headquartered in Cambridge, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MHK', 'Mohawk Industries Inc', 'Mohawk Industries is an American flooring manufacturer based in Calhoun, Georgia, United States. Mohawk produces floor covering products for residential and commercial applications in North America and residential applications in Europe.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TAP', 'Molson Coors Brewing Co Class B', 'The Molson Coors Beverage Company, commonly known as Molson Coors, is a multinational drink and brewing company headquartered in Chicago in the United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MDLZ', 'Mondelez International Inc', 'Mondelez International, Inc. is an American multinational confectionery, food, holding and beverage and snack food company based in Chicago, Illinois.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MPWR', 'Monolithic Power Systems Inc', 'Monolithic Power Systems, Inc. is an American, publicly traded company headquartered in Kirkland, Washington. The company provides power circuits for systems found in cloud computing, telecom infrastructures, automotive, industrial applications and consumer applications.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MNST', 'Monster Beverage Corp', 'Monster Beverage Corporation is an American beverage company that manufactures energy drinks including Monster Energy, Relentless and Burn.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MCO', 'Moodys Corporation', 'Moodys Corporation, often referred to as Moodys, is an American business and financial services company. It is the holding company for Moodys Investors Service (MIS), an American credit rating agency, and Moodys Analytics (MA), an American provider of financial analysis software and services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MS', 'Morgan Stanley', 'Morgan Stanley is an American multinational investment bank and financial services company headquartered at 1585 Broadway in the Morgan Stanley Building, Midtown Manhattan, New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MSI', 'Motorola Solutions Inc', 'Motorola Solutions, Inc., is an American data communications and telecommunications equipment provider that succeeded Motorola, Inc., following the spinoff of the mobile phone division into Motorola Mobility in 2011. The company is headquartered in Chicago, Illinois.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MSCI', 'MSCI Inc', 'MSCI Inc. (formerly Morgan Stanley Capital International and MSCI Barra), is an American finance company headquartered in New York City and serving as a global provider of equity, fixed income, hedge fund stock market indexes, multi-asset portfolio analysis tools and ESG products. It publishes the MSCI BRIC, MSCI World and MSCI EAFE Indexes.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NDAQ', 'Nasdaq Inc', 'Nasdaq, Inc. is an American multinational financial services corporation that owns and operates stock exchanges in the United States and Europe. It is headquartered in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NTAP', 'NetApp Inc', 'NetApp, Inc. is an American hybrid cloud data services and data management company headquartered in Sunnyvale, California. Founded in 1992 with an IPO in 1995, NetApp offers cloud data services for management of applications and data both online and physically.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NFLX', 'Netflix Inc', 'Netflix, Inc. is an American over-the-top content platform and production company headquartered in Los Gatos, California. Netflix was founded in 1997 by Reed Hastings and Marc Randolph in Scotts Valley, California. The companys primary business is a subscription-based streaming service offering online streaming from a library of films and television series, including those produced in-house.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NWL', 'Newell Brands Inc', 'Newell Brands is an American worldwide manufacturer, marketer and distributor of consumer and commercial products with a portfolio of brands.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NEM', 'Newmont Goldcorp Corp', 'Newmont Corporation, based in Greenwood Village, Colorado, United States, is one of the largest gold mining companies in the world.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NWSA', 'News Corp A', 'News Corporation is an American mass media and publishing company operating across digital real estate information, news media, book publishing, and cable television.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NWS', 'News Corp B', 'News Corporation is an American mass media and publishing company operating across digital real estate information, news media, book publishing, and cable television.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NEE', 'Nextera Energy Inc', 'NextEra Energy, Inc. is an American energy company with about 46 gigawatts of generating capacity, revenues of over $17 billion in 2017, and about 14,000 employees throughout the US and Canada. Its subsidiaries include Florida Power & Light (FPL), NextEra Energy Resources, NextEra Energy Partners, Gulf Power Company, and NextEra Energy Services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NKE', 'Nike Inc', 'Nike, Inc. is an American multinational corporation that is engaged in the design, development, manufacturing, and worldwide marketing and sales of footwear, apparel, equipment, accessories, and services. The company is headquartered near Beaverton, Oregon, in the Portland metropolitan area. It is the worlds largest supplier of athletic shoes and apparel and a major manufacturer of sports equipment.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NI', 'NiSource Inc', 'NiSource Inc. is one of the largest fully regulated utility companies in the United States. The company is based in Merrillville, Indiana.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NSC', 'Norfolk Southern Corporation', 'The Norfolk Southern Railway is a Class I freight railroad in the United States, and is the current name of the former Southern Railway. With headquarters in Atlanta, Georgia, the company operates 19,420 route miles (31,250 km) in 22 eastern states, the District of Columbia, and has rights in Canada over the Albany to Montreal route of the Canadian Pacific Railway, and previously on CN from Buffalo to St. Thomas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NTRS', 'Northern Trust Corporation', 'Northern Trust Corporation is a financial services company headquartered in Chicago, Illinois that caters to corporations, institutional investors, and ultra high net worth individuals.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NOC', 'Northrop Grumman Corporation', 'Northrop Grumman Corporation (NYSE: NOC) is an American multinational aerospace and defense technology company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NCLH', 'Norwegian Cruise Line Holdings Ltd', 'Norwegian Cruise Line Holdings Ltd., is a cruise company in North America, Europe, Asia-Pacific and internationally. The company is headquartered in Miami, Florida.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NRG', 'NRG Energy Inc', 'NRG Energy, Inc. is a large American energy company, headquartered in Houston, Texas. It was formerly the wholesale arm of Northern States Power Company (NSP), which became Xcel Energy, but became independent in 2000. NRG Energy is involved in energy generation and retail electricity.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NUE', 'Nucor Corp', 'Nucor Corporation is a producer of steel and related products based in Charlotte, North Carolina.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NVDA', 'NVIDIA Corporation', 'Nvidia Corporation is an American multinational technology company incorporated in Delaware and based in Santa Clara, California. It designs graphics processing units (GPUs) for the gaming and professional markets, as well as system on a chip units (SoCs) for the mobile computing and automotive market.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NVR', 'NVR Inc', 'NVR, Inc. is a company engaged in home construction. It also operates a mortgage banking and title services business. The company primarily operates on the East Coast of the United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NXPI', 'NXP Semiconductors NV', 'NXP Semiconductors N.V. is a Dutch semiconductor manufacturer with headquarters in Eindhoven, Netherlands.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ORLY', 'O’Reilly Automotive Inc', 'OReilly Auto Parts is an American auto parts retailer that provides automotive aftermarket parts, tools, supplies, equipment, and accessories in the United States serving both the professional service providers and do-it-yourself customers.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'OXY', 'Occidental Petroleum Corporation', 'Occidental Petroleum Corporation is an American company engaged in hydrocarbon exploration in the United States, the Middle East, and Colombia as well as petrochemical manufacturing in the United States, Canada, and Chile.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ODFL', 'Old Dominion Freight Line Inc', 'Old Dominion Freight Line, Inc. is an American less than truckload shipping (LTL) company. It offers regional, inter-regional and national LTL service. In addition to its core LTL services, the company offers logistics services including ground and air expedited transportation, supply chain consulting, transportation management, truckload brokerage, container delivery and warehousing, as well as household moving services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'OMC', 'Omnicom Group Inc', 'Omnicom Group Inc. is an American global media, marketing and corporate communications holding company, headquartered in New York City.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'OKE', 'ONEOK Inc', 'Oneok, Inc. is a diversified Fortune 500 energy corporation based in Tulsa, Oklahoma.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ORCL', 'Oracle Corporation', 'Oracle is an American multinational computer technology corporation headquartered in Austin, Texas. The company was formerly headquartered in Redwood Shores, California until December 2020 when it moved its headquarters to Texas. The company sells database software and technology, cloud engineered systems, and enterprise software products, particularly its own brands of database management systems.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'OGN', 'Organon & Co', 'Organon & Co. is an American pharmaceutical company headquartered in Jersey City, New Jersey. Organon specializes in the following core therapeutic fields: reproductive medicine, contraception, psychiatry, Hormone replacement therapy (HRT), and anesthesia. The company sells to international markets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'OTIS', 'Otis Worldwide Corp', 'Otis Worldwide Corporation is an American company that develops, manufactures and markets elevators, escalators, moving walkways, and related equipment.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PCAR', 'PACCAR Inc', 'PACCAR Inc is an American Fortune 500 company and counts among the largest manufacturers of medium- and heavy-duty trucks in the world. PACCAR is engaged in the design, manufacture and customer support of light-, medium- and heavy-duty trucks under the Kenworth, Peterbilt, Leyland Trucks, and DAF nameplates. PACCAR also designs and manufactures powertrains, provides financial services and information technology, and distributes truck parts related to its principal business.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PKG', 'Packaging Corp of America', 'Packaging Corporation of America is an American manufacturing company based in Lake Forest, Illinois.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PH', 'Parker-Hannifin Corporation', 'Parker-Hannifin Corporation, originally Parker Appliance Company, usually referred to as just Parker, is an American corporation specializing in motion and control technologies. Its corporate headquarters are in Mayfield Heights, Ohio, in Greater Cleveland.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PAYX', 'Paychex Inc', 'Paychex, Inc. is an American provider of human resource, payroll, and benefits outsourcing services for small- to medium-sized businesses.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PAYC', 'Paycom Soft', 'Paycom Software, Inc., known simply as Paycom, is an American online payroll and human resource technology provider based in Oklahoma City, Oklahoma.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PYPL', 'PayPal Holdings Inc', 'PayPal Holdings, Inc. is an American company operating an online payments system in the majority of countries that support online money transfers, and serves as an electronic alternative to traditional paper methods like checks and money orders. The company operates as a payment processor for online vendors, auction sites, and many other commercial users, for which it charges a fee.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PENN', 'Penn National Gaming Inc', 'Penn National Gaming, Inc. is an American operator of casinos and racetracks, based in Wyomissing, Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PNR', 'Pentair PLC', 'Pentair plc (PNR) is an American water treatment company with its main U.S. office in Minneapolis, Minnesota.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PEP', 'PepsiCo Inc', 'PepsiCo, Inc. is an American based multinational food, snack, and beverage corporation headquartered in Harrison, New York, in the hamlet of Purchase. PepsiCos business encompasses all aspects of the food and beverage market. It oversees the manufacturing, distribution, and marketing of its products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PFE', 'Pfizer Inc', 'Pfizer Inc. is an American multinational pharmaceutical and biotechnology corporation headquartered on 42nd Street in Manhattan, New York City. The name of the company commemorates its co-founder, Charles Pfizer (1824-1906). Pfizer develops and produces medicines and vaccines for immunology, oncology, cardiology, endocrinology, and neurology. The company has several blockbuster drugs or products that each generate more than 1 billion USD in annual revenues.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PM', 'Philip Morris International Inc', 'Philip Morris International Inc. (PMI) is a Swiss-American multinational cigarette and tobacco manufacturing company, with products sold in over 180 countries. The most recognized and best selling product of the company is Marlboro.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PSX', 'Phillips 66', 'The Phillips 66 Company is an American multinational energy company headquartered in Westchase, Houston, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PNW', 'Pinnacle West Capital Corp', 'Pinnacle West Capital is a utility holding company that owns Arizona Public Service and Bright Canyon Energy.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PXD', 'Pioneer Natural Resources Co', 'Pioneer Natural Resources Company is a company engaged in hydrocarbon exploration headquartered in Irving, Texas. It operates in the Cline Shale, which is part of the Spraberry Trend of the Permian Basin, where the company is the largest acreage holder.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PNC', 'PNC Financial Services Group Inc', 'PNC Financial Services Group, Inc. (stylized as PNC) is a bank holding company and financial services corporation based in Pittsburgh, Pennsylvania. Its banking subsidiary, PNC Bank, operates in 21 states and the District of Columbia with 2,296 branches and 9,051 ATMs. The company also provides financial services such as asset management, wealth management, estate planning, loan servicing, and information processing.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'POOL', 'Pool Corporation', 'Pool Corporation is a major distributor of swimming pool supplies, equipment, and related outdoor products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PPG', 'PPG Industries Inc', 'PPG Industries, Inc. is an American Fortune 500 company and global supplier of paints, coatings, and specialty materials. With headquarters in Pittsburgh, Pennsylvania, PPG operates in more than 70 countries around the globe.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PPL', 'PPL Corporation', 'PPL Corporation is an energy company headquartered in Allentown, Pennsylvania, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PFG', 'Principal Financial Group Inc', 'Principal Financial Group is an American global financial investment management and insurance company headquartered in Des Moines, Iowa.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PG', 'Procter & Gamble Company', 'The Procter & Gamble Company (P&G) is an American multinational consumer goods corporation headquartered in Cincinnati, Ohio, founded in 1837 by William Procter and James Gamble. It specializes in a wide range of personal health, consumer health, personal care, and hygiene products; these products are organized into several segments including Beauty; Grooming; Health Care; Fabric & Home Care; and Baby, Feminine, & Family Care. Before the sale of Pringles to Kelloggs, its product portfolio also included food, snacks, and beverages.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PGR', 'Progressive Corp', 'The Progressive Corporation is an American insurance company, one of the largest providers of car insurance in the United States. The company insures motorcycles, boats, RVs, and commercial vehicles and provides home insurance through select companies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PLD', 'Prologis Inc', 'Prologis, Inc. is a real estate investment trust headquartered in San Francisco, California that invests in logistics facilities, with a focus on the consumption side of the global supply chain.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PRU', 'Prudential Financial Inc', 'Prudential Financial, Inc. is an American company whose subsidiaries provide insurance, investment management, and other financial products and services to both retail and institutional customers throughout the United States and in over 40 other countries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PTC', 'PTC Inc', 'PTC Inc. is an American computer software and services company founded in 1985 and headquartered in Boston, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PEG', 'Public Service Enterprise Group Inc', 'The Public Service Enterprise Group (PSEG) is a publicly traded diversified energy company headquartered in Newark, New Jersey.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PSA', 'Public Storage', 'Public Storage is an American international self storage company headquartered in Glendale, California, that is run as a real estate investment trust (REIT).');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PHM', 'PulteGroup Inc', 'PulteGroup, Inc. (previously known as Pulte Homes) is a home construction company based in Atlanta, Georgia, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PVH', 'PVH Corp', 'PVH Corp., formerly known as the Phillips-Van Heusen Corporation, is an American clothing company which owns brands such as Van Heusen, Tommy Hilfiger, Calvin Klein, IZOD, Arrow, Warners, Olga, True & Co., and Geoffrey Beene.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'QRVO', 'Qorvo Inc', 'Qorvo is an American semiconductor company that designs, manufactures, and supplies radio-frequency systems for applications that drive wireless and broadband communications, as well as foundry services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'QCOM', 'Qualcomm Incorporated', 'Qualcomm is an American multinational corporation headquartered in San Diego, California, and incorporated in Delaware. It creates semiconductors, software, and services related to wireless technology. It owns patents critical to the 5G, 4G, CDMA2000, TD-SCDMA and WCDMA mobile communications standards.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'PWR', 'Quanta Services Inc', 'Quanta Services is an American corporation that provides infrastructure services for electric power, pipeline, industrial and communications industries. Capabilities include the planning, design, installation, program management, maintenance and repair of most types of network infrastructure.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DGX', 'Quest Diagnostics Incorporated', 'Quest Diagnostics is an American clinical laboratory. A Fortune 500 company, Quest operates in the United States, Puerto Rico, Mexico, and Brazil. Quest also maintains collaborative agreements with various hospitals and clinics across the globe.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RL', 'Ralph Lauren Corp Class A', 'Ralph Lauren Corporation is an American fashion company producing products ranging from the mid-range to the luxury segments. They are known for the clothing, marketing and distribution of products in four categories: apparel, home, accessories, and fragrances.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RJF', 'Raymond James Financial Inc.', 'Raymond James Financial is an American multinational independent investment bank and financial services company providing financial services to individuals, corporations, and municipalities through its subsidiary companies that engage primarily in investment and financial planning, in addition to investment banking and asset management.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RTX', 'Raytheon Technologies Corp', 'Raytheon Technologies Corporation is an American multinational aerospace and defense conglomerate headquartered in Waltham, Massachusetts. It is one of the largest aerospace, intelligence services providers, and defense manufacturers in the world by revenue and market capitalization. Raytheon Technologies (RTX) researches, develops, and manufactures advanced technology products in the aerospace and defense industry, including aircraft engines, avionics, aerostructures, cybersecurity, guided missiles, air defense systems, satellites, and drones.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'O', 'Realty Income Corp', 'Realty Income Corporation is a real estate investment trust that invests in free-standing, single-tenant commercial properties in the United States, Puerto Rico, and the United Kingdom that are subject to NNN Leases. The company is organized in Maryland with its headquarters in San Diego, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'REG', 'Regency Centers Corporation', 'Regency Centers Corporation is a real estate investment trust based in Jacksonville, Florida and is one of the largest operators of shopping centers with grocery stores as anchor tenants.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'REGN', 'Regeneron Pharmaceuticals Inc', 'Regeneron Pharmaceuticals, Inc. is an American biotechnology company headquartered in Westchester County, New York. Originally focused on neurotrophic factors and their regenerative capabilities, giving rise to its name, the company then branched out into the study of both cytokine and tyrosine kinase receptors.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RF', 'Regions Financial Corporation', 'Regions Financial Corporation is a bank holding company headquartered in the Regions Center in Birmingham, Alabama. The company provides retail banking and commercial banking, trust, stockbrokerage, and mortgage services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RSG', 'Republic Services Inc', 'Republic Services, Inc is the second largest provider of non-hazardous solid waste collection, transfer, disposal, recycling, and energy services in the United States, as measured by revenue.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RMD', 'ResMed Inc', 'ResMed is a San Diego, California-based medical equipment company. It primarily provides cloud-connectable medical devices for the treatment of sleep apnea (such as CPAP devices and masks), chronic obstructive pulmonary disease (COPD), and other respiratory conditions.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RHI', 'Robert Half International Inc', 'Robert Half International, or commonly referred as, Robert Half, is a global human resource consulting firm based in Menlo Park, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ROK', 'Rockwell Automation Inc', 'Rockwell Automation, Inc. is an American provider of industrial automation and information technology. Its brands include Allen-Bradley and Factory Talk software.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ROL', 'Rollins Inc', 'Rollins, Inc. is a North American consumer and commercial services company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ROP', 'Roper Technologies Inc. Common Stock', 'Roper Technologies, Inc. (formerly Roper Industries, Inc.) is an American diversified industrial company that produces engineered products for global niche markets. The company is headquartered in Sarasota, Florida.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ROST', 'Ross Stores Inc', 'Ross Stores, Inc., operating under the brand name Ross Dress for Less, is an American chain of discount department stores headquartered in Dublin, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'RCL', 'Royal Caribbean Cruises Ltd', 'Royal Caribbean Group, formerly known as Royal Caribbean Cruises Ltd., is an American global cruise holding company incorporated in Liberia and based in Miami, Florida, US.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SPGI', 'S&P Global Inc', 'S&P Global Inc. is an American publicly traded corporation headquartered in Manhattan, New York City. Its primary areas of business are financial information and analytics.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'CRM', 'Salesforce.com Inc', 'Salesforce.com, Inc. is an American cloud-based software company headquartered in San Francisco, California. It provides customer relationship management (CRM) service and also provides a complementary suite of enterprise applications focused on customer service, marketing automation, analytics, and application development.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SBAC', 'SBA Communications Corp', 'SBA Communications Corporation is a real estate investment trust which owns and operates wireless infrastructure in the United States, Canada, Central America, South America, and South Africa.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SLB', 'Schlumberger NV', 'Schlumberger Limited is an oilfield services company. Schlumberger has four principal executive offices located in Paris, Houston, London, and The Hague.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'STX', 'Seagate Technology PLC', 'Seagate Technology Holdings plc, an Irish public limited company (commonly referred to as Seagate) is an American data storage company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SEE', 'Sealed Air Corporation', 'Sealed Air Corporation is a packaging company known for its brands: Cryovac food packaging and Bubble Wrap cushioning packaging.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SRE', 'Sempra Energy', 'Sempra Energy is a North American energy infrastructure company based in San Diego, California. Sempra Energys focus is on electric and natural gas infrastructure. Its operating companies include: Southern California Gas Company (SoCalGas) and San Diego Gas & Electric (SDG&E) in Southern California; Oncor Electric Delivery Company (Oncor) in Texas; Sempra LNG; and IEnova, based in Mexico.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'NOW', 'ServiceNow Inc', 'ServiceNow is an American software company based in Santa Clara, California that develops a cloud computing platform to help companies manage digital workflows for enterprise operations.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SHW', 'Sherwin-Williams Co', 'Sherwin Williams Company is a Cleveland, Ohio based company in the paint and coating manufacturing industry. The company primarily engages in the manufacture, distribution, and sale of paints, coatings, floorcoverings, and related products to professional, industrial, commercial, and retail customers primarily in North and South America and Europe.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SPG', 'Simon Property Group Inc', 'Simon Property Group, Inc. is a real estate investment trust that invests in shopping malls, outlet centers, and community/lifestyle centers. It is the largest owner of shopping malls in the United States and is headquartered in Indianapolis, Indiana.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SWKS', 'Skyworks Solutions Inc', 'Skyworks Solutions, Inc. is an American semiconductor company headquartered in Irvine, California, United States. Skyworks manufactures semiconductors for use in Radio Frequency (RF) and mobile communications systems.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SNA', 'Snap-On Inc', 'Snap-on Incorporated is an American designer, manufacturer and marketer of high-end tools and equipment for professional use in the transportation industry including the automotive, heavy duty, equipment, marine, aviation, and railroad industries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SO', 'Southern Company', 'Southern Company is an American gas and electric utility holding company based in the southern United States. It is headquartered in Atlanta, Georgia, with executive offices also located in Birmingham, Alabama.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'LUV', 'Southwest Airlines Company', 'Southwest Airlines Co., typically referred to as Southwest, is one of the major airlines of the United States and the worlds largest low-cost carrier airline. It is headquartered in Dallas, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SWK', 'Stanley Black & Decker Inc', 'Stanley Black & Decker, Inc., formerly known as The Stanley Works, is a Fortune 500 American manufacturer of industrial tools and household hardware and provider of security products. Headquartered in the greater Hartford city of New Britain, Connecticut, Stanley Black & Decker is the result of the merger of Stanley Works and Black & Decker on March 12, 2010.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SBUX', 'Starbucks Corporation', 'Starbucks Corporation is an American multinational chain of coffeehouses and roastery reserves headquartered in Seattle, Washington. As the worlds largest coffeehouse chain, Starbucks is seen to be the main representation of the United States second wave of coffee culture.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'STT', 'State Street Corp', 'State Street Corporation is an American financial services and bank holding company headquartered at One Lincoln Street in Boston with operations worldwide.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'STE', 'STERIS plc', 'Steris Corporation is an American Irish-domiciled medical equipment company specializing in sterilization and surgical products for the US healthcare system.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SYK', 'Stryker Corporation', 'Stryker Corporation is an American multinational medical technologies corporation based in Kalamazoo, Michigan. Strykers products include implants used in joint replacement and trauma surgeries; surgical equipment and surgical navigation systems; endoscopic and communications systems; patient handling and emergency medical equipment; neurosurgical, neurovascular and spinal devices; as well as other medical device products used in a variety of medical specialties.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SYF', 'Synchrony Financial', 'Synchrony Financial is a consumer financial services company headquartered in Stamford, Connecticut, United States. The company offers consumer financing products, including credit, promotional financing and loyalty programs, installment lending to industries, and FDIC-insured consumer savings products through Synchrony Bank, its wholly owned online bank subsidiary.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SNPS', 'Synopsys Inc', 'Synopsys is an American electronic design automation company that focuses on silicon design and verification, silicon intellectual property and software security and quality. Products include logic synthesis, behavioral synthesis, place and route, static timing analysis, formal verification, hardware description language (SystemC, SystemVerilog/Verilog, VHDL) simulators, and transistor-level circuit simulation.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'SYY', 'Sysco Corporation', 'Sysco Corporation is an American multinational corporation involved in marketing and distributing food products, smallwares, kitchen equipment and tabletop items to restaurants, healthcare and educational facilities, hospitality businesses like hotels and inns, and wholesale to other companies that provide foodservice (like Aramark and Sodexo). The company is headquartered in the Energy Corridor district of Houston, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TMUS', 'T-Mobile US Inc', 'T-Mobile US, Inc., doing business under the global brand name T-Mobile, is an American wireless network operator. Its headquarters are located in Bellevue, Washington, in the Seattle metropolitan area and Overland Park, Kansas, in the Kansas City metropolitan area.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TROW', 'T. Rowe Price Group Inc', 'T. Rowe Price Group, Inc. is an American publicly owned global investment management firm that offers funds, advisory services, account management, and retirement plans and services for individuals, institutions, and financial intermediaries.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TTWO', 'Take-Two Interactive Software Inc', 'Take-Two Interactive Software, Inc. is an American video game holding company based in New York City. The company owns two major publishing labels, Rockstar Games and 2K, which operate internal game development studios.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TPR', 'Tapestry Inc', 'Tapestry, Inc. is an American multinational luxury fashion holding company. It is based in New York City and is the parent company of three major brands: Coach New York, Kate Spade New York and Stuart Weitzman.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TGT', 'Target Corporation', 'Target Corporation is an American retail corporation. Their retail formats include the discount store Target, the hypermarket SuperTarget, and small-format stores previously named CityTarget and TargetExpress before being consolidated under the Target branding.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TEL', 'TE Connectivity Ltd', 'TE Connectivity is an American Swiss-domiciled technology company that designs and manufactures connectors and sensors for several industries, such as automotive, industrial equipment, data communication systems, aerospace, defense, medical, oil and gas, consumer electronics and energy.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TDY', 'Teledyne Technologies Incorporated', 'Teledyne Technologies Incorporated is an American industrial conglomerate.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TFX', 'Teleflex Incorporated', 'Teleflex Incorporated, headquartered in Wayne, Pennsylvania, is an American provider of specialty medical devices for a range of procedures in critical care and surgery.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TER', 'Teradyne Inc', 'Teradyne, Inc. is an American automatic test equipment (ATE) designer and manufacturer based in North Reading, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TSLA', 'Tesla Inc', 'Tesla, Inc. is an American electric vehicle and clean energy company based in Palo Alto, California. Teslas current products include electric cars, battery energy storage from home to grid-scale, solar panels and solar roof tiles, as well as other related products and services. In 2020, Tesla had the highest sales in the plug-in and battery electric passenger car segments, capturing 16% of the plug-in market (which includes plug-in hybrids) and 23% of the battery-electric (purely electric) market. Through its subsidiary Tesla Energy, the company develops and is a major installer of solar photovoltaic energy generation systems in the United States. Tesla Energy is also one of the largest global suppliers of battery energy storage systems, with 3 GWh of battery storage supplied in 2020.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TXN', 'Texas Instruments Incorporated', 'Texas Instruments Incorporated (TI) is an American technology company headquartered in Dallas, Texas, that designs and manufactures semiconductors and various integrated circuits, which it sells to electronics designers and manufacturers globally. It is one of the top 10 semiconductor companies worldwide based on sales volume.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TXT', 'Textron Inc', 'Textron Inc. is an American industrial conglomerate based in Providence, Rhode Island. Textrons subsidiaries include Arctic Cat, Bell Textron, Textron Aviation (which itself includes the Beechcraft, Hawker, and Cessna brands), and Lycoming Engines.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'COO', 'Cooper Companies Inc', 'The Cooper Companies, Inc., branded as CooperCompanies, is a global medical device company headquartered in San Ramon, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HIG', 'Hartford Financial Services Group', 'The Hartford Financial Services Group, Inc., usually known as The Hartford, is a United States-based investment and insurance company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'HSY', 'Hershey Co', 'The Hershey Company, commonly known as Hersheys, is an American multinational company and one of the largest chocolate manufacturers in the world. It also manufactures baked products, such as cookies and cakes, and sells beverages like milkshakes, and many more that are produced globally. Its headquarters are in Hershey, Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'MOS', 'The Mosaic Company', 'The Mosaic Company is a Fortune 500 company based in Tampa, Florida which mines phosphate and potash, and operates through segments such as international distribution and Mosaic Fertilizantes.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TRV', 'The Travelers Companies Inc', 'The Travelers Companies, Inc., commonly known as Travelers, is an American insurance company.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'DIS', 'Walt Disney Company', 'The Walt Disney Company, commonly known as Disney, is an American diversified multinational mass media and entertainment conglomerate headquartered at the Walt Disney Studios complex in Burbank, California.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TMO', 'Thermo Fisher Scientific Inc', 'Thermo Fisher Scientific is an American provisioner of scientific instrumentation, reagents and consumables, and software and services to healthcare, life science, and other laboratories in academia, government, and industry (including in the biotechnology and pharmaceutical sectors). Based in Waltham, Massachusetts, Thermo Fisher was created in 2006 by the merger of Thermo Electron and Fisher Scientific, to form a company with US$ 9 billion in combined revenues.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TJX', 'The TJX Companies Inc', 'The TJX Companies, Inc. (abbreviated TJX) is an American multinational off-price department store corporation, headquartered in Framingham, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TSCO', 'Tractor Supply Company', 'Tractor Supply Company (TSCO) is an American retail chain of stores that offers products for home improvement, agriculture, lawn and garden maintenance, livestock, equine and pet care.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TT', 'Trane Technologies plc', 'Trane Technologies plc is an American Irish domiciled diversified industrial manufacturing company. It is headquartered near Dublin, Ireland.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TDG', 'Transdigm Group Incorporated', 'TransDigm Group is a publicly traded aerospace manufacturing company headquartered in Cleveland, Ohio. TransDigm develops and manufactures engineered aerospace components.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TRMB', 'Trimble Inc', 'Trimble Inc. is a Sunnyvale, California-based hardware, software and services technology company. Trimble services global industries in Agriculture, Building & Construction, Geospatial, Natural Resources and Utilities, Governments, Transportation and others. Trimble also does hardware development of Global Navigation Satellite System (GNSS) receivers, scanners, laser rangefinders, unmanned aerial vehicles (UAVs), inertial navigation systems and software processing tools.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TFC', 'Truist Financial Corp', 'Truist Financial Corporation is an American bank holding company headquartered in Charlotte, North Carolina. Its bank operates 2,781 branches in 15 states and Washington, D.C., and offers consumer and commercial banking, securities brokerage, asset management, mortgage, and insurance products and services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TYL', 'Tyler Technologies Inc', 'Tyler Technologies, Inc., based in Plano, Texas, is the largest provider of software to the United States public sector.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'TSN', 'Tyson Foods Inc', 'Tyson Foods, Inc. is an American multinational corporation based in Springdale, Arkansas, that operates in the food industry.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'USB', 'U.S. Bancorp', 'U.S. Bancorp is an American bank holding company based in Minneapolis, Minnesota, and incorporated in Delaware. The company provides banking, investment, mortgage, trust, and payment services products to individuals, businesses, governmental entities, and other financial institutions.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'UDR', 'UDR Inc', 'UDR Inc. is a publicly traded real estate investment trust that invests in apartments. The company is organized in Maryland with its headquarters in Highlands Ranch, Colorado.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'ULTA', 'Ulta Beauty Inc', 'Ulta Beauty, Inc., formerly known as Ulta Salon, Cosmetics & Fragrance Inc., is an American chain of beauty stores headquartered in Bolingbrook, Illinois. Ulta Beauty carries cosmetics and skincare brands, mens and womens fragrances, nail products, bath and body products, beauty tools and haircare products.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'UAA', 'Under Armour Inc A', 'Under Armour, Inc. is an American sports equipment company that manufactures footwear, sports and casual apparel. Under Armours global headquarters are located in Baltimore, Maryland.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'UA', 'Under Armour Inc C', 'Under Armour, Inc. is an American sports equipment company that manufactures footwear, sports and casual apparel. Under Armours global headquarters are located in Baltimore, Maryland.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'UNP', 'Union Pacific Corporation', 'The Union Pacific Corporation (Union Pacific) is a publicly traded railroad holding company. It was incorporated in Utah in 1969 and is headquartered in Omaha, Nebraska. It is the parent company of the current, Delaware-registered, form of the Union Pacific Railroad.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'UAL', 'United Airlines Holdings Inc', 'United Airlines Holdings, Inc. (formerly known as United Continental Holdings, Inc., UAL Corporation, Allegis Corporation and founded originally as UAL, Inc.) is a publicly traded airline holding company headquartered in the Willis Tower in Chicago. UAH owns and operates United Airlines, Inc.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'UPS', 'United Parcel Service Inc', 'United Parcel Service is an American multinational shipping & receiving and supply chain management company founded in 1907.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'URI', 'United Rentals Inc', 'United Rentals, Inc. (NYSE: URI) is the worlds largest equipment rental company, with about 13 percent of the North American market share as of 2019.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'UNH', 'UnitedHealth Group Incorporated', 'UnitedHealth Group Incorporated is an American for-profit multinational managed healthcare and insurance company based in Minnetonka, Minnesota. It offers health care products and insurance services. In 2020, it was the second-largest healthcare company (behind CVS Health) by revenue with $257.1 billion, and the largest insurance company by net premiums. UnitedHealthcare revenues comprise 80% of the Groups overall revenue.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'UHS', 'Universal Health Services Inc', 'UnitedHealth Group Incorporated is an American for-profit multinational managed healthcare and insurance company based in Minnetonka, Minnesota. It offers health care products and insurance services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VLO', 'Valero Energy Corporation', 'Valero Energy Corporation is a Fortune 500 international manufacturer and marketer of transportation fuels, other petrochemical products, and power. It is headquartered in San Antonio, Texas, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VTR', 'Ventas Inc', 'Ventas, Inc. is a real estate investment trust specializing in the ownership and management of health care facilities in the United States, Canada and the United Kingdom.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VRSN', 'VeriSign Inc', 'Verisign Inc. is an American company based in Reston, Virginia, United States that operates a diverse array of network infrastructure, including two of the Internets thirteen root nameservers. Verisign also offers a range of security services, including managed DNS, distributed denial-of-service (DDoS) attack mitigation and cyber-threat reporting.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VRSK', 'Verisk Analytics Inc', 'Verisk Analytics, Inc. is an American data analytics and risk assessment firm based in Jersey City, New Jersey, with customers in insurance, natural resources, financial services, government, and risk management sectors. The company uses proprietary data sets and industry expertise to provide predictive analytics and decision support consultations in areas including fraud prevention, actuarial science, insurance coverage, fire protection, catastrophe and weather risk, and data management.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VZ', 'Verizon Communications Inc', 'Verizon Communications Inc. is an American multinational telecommunications conglomerate and a corporate component of the Dow Jones Industrial Average. The company is headquartered at 1095 Avenue of the Americas in Midtown Manhattan, New York City, but is incorporated in Delaware.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VRTX', 'Vertex Pharmaceuticals Inc', 'Vertex Pharmaceuticals, Inc. is an American biopharmaceutical company based in Boston, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VFC', 'VF Corporation', 'VF Corporation is an American worldwide apparel and footwear company founded in 1899 and headquartered in Denver, Colorado. The companys more than 30 brands are organized into three categories: Outdoor, Active and Work.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VTRS', 'Viatris Inc', 'Viatris Inc. is an American global healthcare company headquartered in Canonsburg, Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'V', 'Visa Inc. Class A', 'Visa Inc. is an American multinational financial services corporation headquartered in Foster City, California, United States. It facilitates electronic funds transfers throughout the world, most commonly through Visa-branded credit cards, debit cards and prepaid cards. Visa is one of the worlds most valuable companies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VNO', 'Vornado Realty Trust', 'Vornado Realty Trust is a real estate investment trust formed in Maryland, with its primary office in New York City. The company invests in office buildings and street retail in Manhattan.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'VMC', 'Vulcan Materials Company', 'Vulcan Materials Company (NYSE: VMC) is an American company based in Birmingham, Alabama. It is principally engaged in the production, distribution and sale of construction materials.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WRB', 'W. R. Berkley Corp', 'W. R. Berkley Corporation is a commercial lines property & casualty insurance holding company organized in Delaware and based in Greenwich, Connecticut.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'GWW', 'WW Grainger Inc', 'W. W. Grainger, Inc. is an American Fortune 500 industrial supply company founded in 1927 in Chicago by William W. (Bill) Grainger.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WAB', 'Westinghouse Air Brake Technologies Corp', 'Wabtec Corporation (derived from Westinghouse Air Brake Technologies Corporation) is an American company formed by the merger of the Westinghouse Air Brake Company (WABCO) and MotivePower Industries Corporation in 1999. It is headquartered in Pittsburgh, Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WBA', 'Walgreens Boots Alliance Inc', 'Walgreens Boots Alliance, Inc. is an American pharmaceuticals holding company headquartered in Deerfield, Illinois. It owns the pharmacy chains Walgreens and Boots, as well as several pharmaceutical manufacturing, wholesale, and distribution companies.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WMT', 'Walmart Inc', 'Walmart Inc. is an American multinational retail corporation that operates a chain of hypermarkets, discount department stores, and grocery stores from the United States, headquartered in Bentonville, Arkansas. It also owns and operates Sams Club retail warehouses.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WM', 'Waste Management Inc', 'Waste Management, Inc. is an American waste management, comprehensive waste, and environmental services company in North America. Founded in 1968, the company is headquartered 800 Capitol in Houston, Texas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WAT', 'Waters Corporation', 'Waters Corporation is a publicly traded Analytical Laboratory instrument and software company headquartered in Milford, Massachusetts.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WEC', 'WEC Energy Group Inc', 'WEC Energy Group, based in Milwaukee, Wisconsin, provides electricity and natural gas to 4.4 million customers across four states.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WFC', 'Wells Fargo & Company', 'Wells Fargo & Company is an American multinational financial services company with corporate headquarters in San Francisco, California, operational headquarters in Manhattan, and managerial offices throughout the United States and overseas.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WELL', 'Welltower Inc', 'Welltower Inc. is a real estate investment trust that invests in healthcare infrastructure.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WST', 'West Pharmaceutical Services Inc', 'West Pharmaceutical Services, Inc. is a designer and manufacturer of injectable pharmaceutical packaging and delivery systems. The company is headquartered in Exton, Pennsylvania.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WDC', 'Western Digital Corporation', 'Western Digital Corporation (WDC, commonly known as Western Digital or WD) is an American computer hard disk drive manufacturer and data storage company, headquartered in San Jose, California. It designs, manufactures and sells data technology products, including storage devices, data center systems and cloud storage services.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WU', 'Western Union Co', 'The Western Union Company is an American worldwide financial services and communications company, headquartered in Denver, Colorado.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WRK', 'WestRock Co', 'WestRock is an American corrugated packaging company headquartered in Sandy Springs, Georgia.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WY', 'Weyerhaeuser Company', 'Weyerhaeuser Company is an American timberland company which owns nearly 12,400,000 acres of timberlands in the U.S. and manages an additional 14,000,000 acres timberlands under long-term licenses in Canada. The company also manufactures wood products. Weyerhaeuser is a real estate investment trust.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WHR', 'Whirlpool Corporation', 'The Whirlpool Corporation is an American multinational manufacturer and marketer of home appliances, headquartered in Benton Charter Township, Michigan, United States.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WMB', 'Williams Companies Inc', 'The Williams Companies, Inc., is an American energy company based in Tulsa, Oklahoma. Its core business is natural gas processing and transportation, with additional petroleum and electricity generation assets.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'WYNN', 'Wynn Resorts Limited', 'Wynn Resorts, Limited is an American publicly traded corporation based in Paradise, Nevada that is a developer and operator of high end hotels and casinos.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'XEL', 'Xcel Energy Inc', 'Xcel Energy Inc. is a utility holding company based in Minneapolis, Minnesota, serving more than 3.7 million electric customers and 2.1 million natural gas customers in Minnesota, Michigan, Wisconsin, North Dakota, South Dakota, Colorado, Texas, and New Mexico as of 2019. It consists of four operating subsidiaries: Northern States Power-Minnesota, Northern States Power-Wisconsin, Public Service Company of Colorado, and Southwestern Public Service Co.');
insert into asset (AssetTypeid, Symbol, assetname, description) values            (1, 'XYL', 'Xylem Inc', 'Xylem Inc. is a large American water technology provider, in public utility, residential, commercial, agricultural and industrial settings.');
